fragment:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tick_borne_relapsing_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hepatosplenomegaly ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lymphadenopathy ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :tachypnea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :relapsing_fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :enlargement_of_lymph_nodes ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :tick_borne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :tachycardia ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :ornithodoros_parkeri ],
        :relapsing_fever ;
    :has_definition "A relapsing fever that is characterized by relapsing or recurring episodes of fever, has_material_basis_in Borrelia hermsii, has_material_basis_in Borrelia parkeri or has_material_basis_in Borrelia duttoni, which are transmitted_by soft ticks (Ornithodoros parkeri and Ornithodoros hermsii). The infection has_symptom tachypnea, has_symptom tachycardia, has_symptom hepatosplenomegaly and has_symptom lymphadenopathy." ;
    :has_exact_synonym "soft tick relapsing fever",
        "Relapsing fever, tick-borne"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_sphenoidal_sinusitis rdfs:subClassOf :sphenoid_sinusitis ;
    :has_definition "A sphenoid sinusitis which lasts for less than 4 weeks." ;
    :has_exact_synonym "Sphenoidal sinus -acute"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:corpus_luteum_cyst rdfs:subClassOf :ovarian_cyst ;
    :has_definition "An ovarian cyst that arises from the accumulation of fluid in the follicle after an oocyte has been release." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:traumatic_glaucoma rdfs:subClassOf :glaucoma ;
    :has_definition "A glaucoma characterized by elevated intraocular pressure secondary to ocular trauma, which leads to glaucomatous optic nerve atrophy and progressive vision loss and has_symptom progressive decreased vision, visual field defects, and decreased peripheral vision. Traumatic glaucoma is caused by ocular trauma that affects aqueous outflow, such as trauma that leads to inflammation or deposition of proteins in the trabecular network, that changes the anterior chamber angle, or that causes chronic inflammation." ;
    :has_exact_synonym "Glaucoma associated with ocular trauma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_osteodystrophy rdfs:subClassOf :kidney_disease ;
    :has_exact_synonym "renal rickets"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dementia rdfs:subClassOf :cognitive_disorder ;
    :has_definition "A cognitive disorder resulting from a loss of brain function affecting memory, thinking, language, judgement and behavior." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acquired_hyperkeratosis rdfs:subClassOf :keratosis ;
    :has_exact_synonym "Keratoderma - acquired"@en,
        "Keratoderma, acquired"@en,
        "acquired keratoderma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tinea_unguium rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :nail ],
        :dermatophytosis,
        :nail_disease ;
    :has_definition "A dermatophytosis that results_in fungal infection located_in nail, has_material_basis_in Ascomycota fungi that belong to a group called dermatophytes, which cause separation of the nail plate from the nail bed and has_symptom thickening of subungueal area. Sometimes, white islands are seen on the external nail plates. These gradually coalesce until the entire nail plate is involved." ;
    :has_exact_synonym "Dermatophytic onychia"@en,
        "Dermatophytosis of nail"@en,
        "Onychomycosis due to dermatophyte"@en,
        "cellulitis and abscess of buttock"@en,
        "cellulitis and abscess of face"@en,
        "cellulitis and abscess of finger"@en,
        "cellulitis and abscess of finger and toe"@en,
        "cellulitis and abscess of gluteal region"@en,
        "cellulitis and abscess of trunk"@en,
        "cellulitis and abscess of upper arm and forearm"@en,
        "dermatophytic onychomycosis"@en ;
    :has_related_synonym "cellulitis and abscess"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:eumycotic_mycetoma rdfs:subClassOf :dermatomycosis ;
    :has_definition "A dermatomycosis that effects skin and subcutaneous tissue located in foot, located in trunk, located in buttocks, located in eyelids, located in lacrimal glands, located in paranasal sinuses, located in mandible, located in scalp, located in neck, located in perineum, or located in testes and has symptom sinus discharge and results in formation of nodules." ;
    :has_exact_synonym "Madura foot"@en,
        "Maduromycosis, mycotic"@en,
        "Mycotic mycetoma"@en,
        "eumycetoma"@en,
        "maduromycosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:jaccoud_s_syndrome rdfs:subClassOf :autoimmune_disease ;
    :has_definition "An autoimmune disease that is characterized by severe non-erosive arthropathy with ulnar deviation of the 2nd to 5th digits and metacarpophalangeal joint subluxation without evidence of synovitis, and may be associated with systemic lupus erythematosus, rheumatic fever, and ligamentous laxity." ;
    :has_exact_synonym "Jaccoud syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hemangioma_of_subcutaneous_tissue rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :superficial_fascia ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :endothelial_cell ],
        :hemangioma,
        :skin_benign_neoplasm ;
    :has_exact_synonym "Angioma of the Subcutaneous tissue"@en,
        "Subcutaneous haemangioma"@en,
        "Subcutaneous hemangioma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lown_ganong_levine_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that involves pre-excitation of the ventricles due to an accessory pathway providing an abnormal electrical communication from the atria to the ventricles." ;
    :has_exact_synonym "atrial tachyarrhythmia with short PR interval"@en,
        "syndrome of short P-R interval, normal QRS complexes, and supraventricular tachycardias"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:branch_retinal_artery_occlusion rdfs:subClassOf :retinal_artery_occlusion ;
    :has_exact_synonym "Arterial retinal branch occlusion"@en,
        "retinal arterial branch occlusion"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vertebral_artery_insufficiency rdfs:subClassOf :artery_disease,
        :syndrome,
        :transient_cerebral_ischemia ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :syndrome ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :vertebral_artery ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Vertebral artery syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sneddon_syndrome rdfs:subClassOf :artery_disease ;
    :has_definition "An artery disease that is characterized by onset of livedo reticularis in the second decade and onset of cerebrovascular disease in early adulthood and that has_material_basis_in compound heterozygous mutation in the CECR1 gene (ADA2) on chromosome 22q11." ;
    :has_exact_synonym "Idiopathic livedo reticularis with systemic involvement"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_retinal_artery_occlusion rdfs:subClassOf :retinal_artery_occlusion ;
    :has_definition "A retinal artery occlusion characterized by blockage of blood flow through the central retinal artery." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:moyamoya_disease rdfs:subClassOf :cerebral_arterial_disease ;
    :has_definition "A cerebral arterial disease characterized by constriction of certain arteries at the base of the brain. Blood flow is blocked by the constriction and also by blood clots." ;
    :has_exact_match "MESH:D009072" ;
    :has_exact_synonym "progressive intracranial arterial occlusion"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bladder_leiomyoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :urinary_bladder ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :smooth_muscle_cell ],
        :bladder_benign_neoplasm,
        :leiomyoma ;
    :has_definition "A bladder benign neoplasm that derives_from smooth muscle cells." ;
    :has_exact_synonym "leiomyoma of the urinary bladder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paronychia rdfs:subClassOf :nail_disease ;
    :has_definition "A nail disease characterized by often-tender bacterial or fungal hand infection or foot infection due to either bacteria or fungus (Candida albicans) where the nail and skin meet at the side or the base of a finger or toe nail. The infection can start suddenly (acute paronychia) or gradually (chronic paronychia). Puss is usually present, along with gradual thickening and browning discoloration of the nail plate." ;
    :has_exact_synonym "Infected nailfold"@en,
        "Onychia and paronychia of finger"@en,
        "Onychia and paronychia of toe"@en,
        "fungal nail infection"@en ;
    :has_related_synonym "paronychia inflammation"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:focal_segmental_glomerulosclerosis rdfs:subClassOf :glomerulosclerosis ;
    :has_exact_synonym "FGS"@en,
        "FSGS"@en,
        "focal glomerular sclerosis"@en,
        "focal glomerulosclerosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:protein_deficiency_anemia rdfs:subClassOf :deficiency_anemia ;
    :has_exact_synonym "Anemia due to protein deficiency"@en,
        "protein-deficiency anaemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:deficiency_anemia rdfs:subClassOf :anemia ;
    :has_exact_synonym "deficiency anemias"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gonococcal_spondylitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        :spondylitis .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:severe_pre_eclampsia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :proteinuria ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cyanosis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :oliguria ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :placental_abruption ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :thrombocytopenia ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :oligohydramnios ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :epigastric_abdominal_pain ],
        :pre_eclampsia ;
    :has_definition "A pre-eclampsia that has_symptom at least one of the following: SBP of 160mm HG or higher or DPB of 110mm HG or higher on 2 occasions at least 6 hours apart, proteinuria more than 5g in a 24-hour collection, pulmonary edema or cyanosis, oliguria, persistent headaches, epigastric pain and/or impaired liver function, thrombocytopenia, oligohydramnios, decreased fetal growth or placental abruption." ;
    :has_exact_synonym "Severe pre-eclampsia, with delivery"@en,
        "antepartum severe pre-eclampsia"@en,
        "postpartum severe pre-eclampsia"@en,
        "severe preeclampsia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hellp_syndrome rdfs:subClassOf :severe_pre_eclampsia ;
    :has_definition "A severe pre-eclampsia characterized by hemolysis, elevated liver enzyme and low platelet count." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hordeolum_externum rdfs:subClassOf :blepharitis ;
    :has_definition "A blepharitis that is characterized by an infection of the sebaceous glands of Zeis at the base of the eyelashes, or an infection of the apocrine sweat glands of Moll." ;
    :has_exact_synonym "external stye"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:werdnig_hoffmann_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :childhood_spinal_muscular_atrophy ;
    :has_definition "A childhood spinal muscular atrophy that is a severe form and is characterized by muscle weakness onset from birth to six months of age, the inability to sit unassisted and that has_material_basis_in a mutation or deletion in the telomeric copy of the SMN gene, known as SMN1, on chromosome 5q13." ;
    :has_exact_synonym "HMN (Hereditary motor Neuropathy) Proximal type I"@en,
        "SMA1"@en,
        "Spinal muscular atrophy 1"@en,
        "hereditary motor neuropathy proximal type I"@en,
        "infantile muscular atrophy"@en,
        "progressive muscular atrophy of infancy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_proliferative_glomerulonephritis rdfs:subClassOf :glomerulonephritis ;
    :has_exact_synonym "acute glomerulonephritis with lesion of proliferative glomerulonephritis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:suppurative_uveitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloodshot_eye ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :uveitis ;
    :has_definition "A uveitis characterized by inflammation and pus formation of the uvea, which are the pigmented layers of the eye consisting of the iris, ciliary body, and choroid, and has_symptom pain, blurry vision, and eye redness. Suppurative uveitis is typically caused by infection, especially by bacterial infection post-operatively or post-traumatically." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:uveitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :uveal_disease ;
    :has_definition "An uveal disease is characterized by inflammation of any of the layers of the uvea of the eye, which includes the iris, ciliary body, and choroid." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:benign_renovascular_hypertension rdfs:subClassOf :benign_secondary_hypertension,
        :renal_hypertension ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_secondary_hypertension ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :kidney ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A benign secondary hypertension that is characterized by chronic elevated blood pressure in the arteries supplying blood to the kidneys and has_material_basis_in renal artery stenosis." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:esophageal_candidiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :esophagus ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bleeding ],
        :candidiasis,
        :esophageal_disease ;
    :has_definition "A candidiasis that involves fungal infection of the esophagus by Candida albicans in immunocompromised people, resulting in lesions, bleeding, painful swallowing and substernal pain." ;
    :has_exact_synonym "Candida Esophagitis"@en,
        "Candidal esophagitis"@en,
        "Candidiasis of the esophagus"@en,
        "esophageal moniliasis"@en,
        "esophageal thrush"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fungal_esophagitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :fungi ],
        :esophagitis,
        :fungal_infectious_disease .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_cystitis rdfs:subClassOf :cystitis ;
    :has_definition "A cystitis characterized by a sudden onset or severe symptoms." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:scrotum_squamous_cell_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :squamous_epithelial_cell ],
        :scrotal_carcinoma,
        :squamous_cell_carcinoma ;
    :has_definition "A squamous cell carcinoma that is located_in the scrotum." ;
    :has_exact_synonym "Scrotal squamous cell carcinoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:scrotum_melanoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :scrotum ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :melanocyte ],
        :melanoma,
        :scrotum_neoplasm ;
    :has_exact_synonym "melanoma of scrotum"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:allergic_bronchopulmonary_aspergillosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :respiratory_tract ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :wheezing ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :allergic_reaction ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :aspergillus ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        :aspergillosis,
        :respiratory_allergy ;
    :has_definition "An aspergillosis that involves an allergic reaction due to the spores of Aspergillus moulds (A. fumigatus), which colonizes the mucus in the airways causing inflammation. The disease has symptom cough, has symptom wheezing and has symptom fever." ;
    :has_exact_synonym "pulmonary aspergillus disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prepuce_cancer rdfs:subClassOf :skin_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :prepuce ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "malignant neoplasm of foreskin"@en,
        "malignant tumor of foreskin"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spermatic_cord_cancer rdfs:subClassOf :male_reproductive_organ_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :spermatic_cord ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Spermatic cord Ca"@en,
        "malignant tumor of spermatic cord"@en,
        "malignant tumor of the Spermatic Cord"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gout rdfs:subClassOf :arthritis ;
    :has_definition "An arthritis that has_material_basis_in uric acid crystal deposits located_in joint." ;
    :has_exact_synonym "Articular gout"@en,
        "Gouty arthropathy"@en,
        "gouty arthritis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brain_cancer rdfs:subClassOf :brain_disease,
        :central_nervous_system_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :brain ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A central nervous system cancer that is characterized by the growth of abnormal cells in the tissues of the brain." ;
    :has_exact_synonym "BT - Brain tumour"@en,
        "adult brain tumor"@en,
        "adult malignant brain neoplasm"@en,
        "brain neoplasm"@en,
        "brain neoplasm, adult"@en,
        "malignant brain tumour"@en,
        "malignant primary brain neoplasm"@en,
        "malignant primary brain tumor"@en,
        "malignant tumor of Brain"@en,
        "malignant tumor of adult brain"@en,
        "neoplasm of brain"@en,
        "primary brain neoplasm"@en,
        "primary brain tumor"@en,
        "primary malignant neoplasm of brain"@en,
        "tumor of the Brain"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nodular_goiter rdfs:subClassOf :goiter ;
    :has_exact_synonym "Goiter, nodular"@en,
        "nodular goitre"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endemic_goiter rdfs:subClassOf :nutritional_deficiency_disease ;
    :has_definition "A nutritional deficiency disease characterized by noncancerous enlargement of the thyroid gland and has_material_basis_in iodine deficiency." ;
    :has_exact_synonym "Iodine-deficiency-related endemic goitre"@en,
        "simple goitre"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:substernal_goiter rdfs:subClassOf :goiter ;
    :has_exact_synonym "Retrosternal thyroid goiter"@en,
        "Retrosternal thyroid goitre"@en,
        "substernal goitre"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:proliferative_diabetic_retinopathy rdfs:subClassOf :diabetic_retinopathy ;
    :has_exact_synonym "PDR"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:background_diabetic_retinopathy rdfs:subClassOf :diabetic_retinopathy ;
    :has_exact_synonym "Non proliferative diabetic retinopathy"@en,
        "Non-Proliferative Diabetic Retinopathy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:right_bundle_branch_block rdfs:subClassOf :heart_conduction_disease ;
    :has_exact_synonym "Right bundle branch block with left posterior fascicular block"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hole_retinal_cyst rdfs:subClassOf :degeneration_of_macula_and_posterior_pole ;
    :has_exact_synonym "Macular cyst or hole"@en,
        "Macular cyst, hole, or pseudohole of retina"@en,
        "Macular pseudohole retinal cyst"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:submucous_uterine_fibroid rdfs:subClassOf :uterine_fibroid ;
    :has_definition "An uterine fibroid that is located adjacent to the lining of the uterus." ;
    :has_exact_synonym "Submucous leiomyoma of uterus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:uterine_fibroid rdfs:subClassOf :uterine_benign_neoplasm ;
    :has_definition "An uterine benign neoplasm derived from the smooth muscle layer of the uterus." ;
    :has_exact_synonym "Plexiform leiomyoma"@en,
        "UTERUS FIBROMA"@en,
        "leiomyoma of Corpus Uteri"@en,
        "uterine leiomyoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oculoglandular_tularemia rdfs:subClassOf :tularemia ;
    :has_definition "A tularemia that results_in inflammation of eye and swelling of lymph glands in front of the ear." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retinal_dystrophies_primarily_involving_bruch_s_membrane rdfs:subClassOf :fundus_dystrophy ;
    :has_exact_synonym "retinal dystrophies primarily involving Bruch membrane"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:haverhill_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_pain ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :streptobacillus_moniliformis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :rash ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results_in infection, has_material_basis_in Streptobacillus moniliformis, which is transmitted_by contact with urine or secretions from the mouth, eye, or nose of an infected animal or transmitted_by bite of an infected animal, especially rat. The infection has_symptom chills, has_symptom fever, has_symptom rash and has_symptom joint pain." ;
    :has_exact_synonym "Streptobacillary fever"@en ;
    :has_related_synonym "Streptobacillary rat-bite fever"@en,
        "Streptobacillosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lung_cancer rdfs:subClassOf :lung_disease,
        :respiratory_system_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :lung ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A respiratory system cancer that is located_in the lung." ;
    :has_related_synonym "lung neoplasm"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tooth_resorption rdfs:subClassOf :teeth_hard_tissue_disease ;
    :has_exact_match "MESH:D014091" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:behcet_s_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_immunoglobulin_level ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :autoimmune_disease_of_cardiovascular_system,
        :vasculitis ;
    :has_definition "A vasculitis that is characterized by an autoimmune mediated inflammation of the blood vessels throughout the body leading to ulcerations on the mouth and sometimes the genitals, notorious for causing hypopyon uveitis." ;
    :has_exact_synonym "Adamantiades-Behcet disease"@en,
        "Behcet syndrome"@en,
        "Behet's syndrome"@en,
        "triple symptom complex"@en ;
    :has_related_synonym "Behcet's syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucocele_of_appendix rdfs:subClassOf :intestinal_disease ;
    :has_exact_synonym "Appendicele Mucocele"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bronchus_cancer rdfs:subClassOf :bronchial_disease,
        :respiratory_system_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :bronchus ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :disease_has_location ;
                                            owl:someValuesFrom :bronchiole ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "A respiratory system cancer that is located_in the bronchus." ;
    :has_exact_synonym "malignant neoplasm of bronchus and lung"@en,
        "malignant neoplasm of bronchus or lung"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diarrhea rdfs:subClassOf :gastrointestinal_system_disease ;
    :has_definition "A gastrointestinal system disease described as the condition of having frequent loose or liquid bowel movements. Acute diarrhea is a common cause of death in developing countries and the second most common cause of infant deaths worldwide. The loss of fluids through diarrhea can cause severe dehydration which is one cause of death in diarrhea sufferers. Along with water, sufferers also lose dangerous amounts of important salts, electrolytes, and other nutrients. There are at least four types of diarrhea: secretory diarrhea, osmotic diarrhea, motility-related diarrhea, and inflammatory diarrhea." ;
    :has_related_synonym "diarrhea of presumed infectious origin"@en,
        "diarrhoea"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diverticulitis_of_colon rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :colonic_disease,
        :diverticulitis ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :diverticulitis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :colon ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A colonic disease characterized by the formation and inflammation of diverticula within the colon wall." ;
    :has_exact_synonym "colonic diverticular disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:typhoid_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :vehicle_borne_ingestion_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :low_white_blood_cell_count ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :prostration ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :salmonella_enterica_subsp_enterica ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :splenomegaly ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that is a communicable systemic illness, has_material_basis_in Salmonella enterica subsp enterica serovar Typhi, which is transmitted_by ingestion of food or water contaminated with the feces of an infected person. The infection has_symptom fever, has_symptom diarrhea, has_symptom prostration, has_symptom headache, has_symptom splenomegaly, has_symptom liver enlargement, has_symptom eruption of rose-colored spots, and has_symptom leukopenia." ;
    :has_exact_synonym "Typhoid"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:porphyria rdfs:subClassOf :inherited_metabolic_disorder ;
    :has_definition "An inherited metabolic disorder that involves certain enzymes in the heme bio-synthetic pathway resulting in the overproduction and accumulation of the porphyrins." ;
    :has_exact_synonym "Hematoporphyria"@en,
        "Porphyrinopathy"@en,
        "disorder of porphyrin and hem metabolism"@en,
        "disorder of porphyrin metabolism"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hereditary_coproporphyria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :digenic_inheritance ],
        :acute_porphyria,
        :digenic_disease ;
    :has_exact_synonym "Coproporphyrinogen oxidase deficiency"@en,
        "hereditary coproporphyria porphyria"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:erythropoietic_protoporphyria rdfs:subClassOf :acute_porphyria ;
    :has_definition "An acute porphyria characterized by a deficiency in the enzyme ferrochelatase, leading to abnormally high levels of protoporphyrin in the tissue." ;
    :has_exact_synonym "EPP"@en,
        "Protoporphyria"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cutaneous_porphyria rdfs:subClassOf :porphyria,
        :skin_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :porphyria ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :zone_of_skin ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Erythropoietic porphyria"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:klebsiella_pneumonia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :klebsiella_pneumoniae ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pleuritic_chest_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hemoptysis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :high_fever ],
        :bacterial_pneumonia ;
    :has_definition "A bacterial pneumonia involving Klebsiella pneumoniae infection. Patients with Klebsiella pneumonia tend to cough up a characteristic sputum that is said to resemble red-currant jelly. Klebsiella pneumonia tends to affect people with underlying diseases, such as alcoholism, diabetes and chronic lung disease. The symptoms include high fever, rigors and pleuritic pain, and hemoptysis." ;
    :has_exact_synonym "Pneumonia due to Klebsiella pneumoniae"@en,
        "Pneumonia due to Klebsiella pneumoniae (disorder)"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mycoplasma_pneumoniae_pneumonia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dry_cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :mycoplasmoides_pneumoniae ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chest_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pharynx_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        :bacterial_pneumonia ;
    :has_definition "A bacterial pneumonia that is caused by the bacterial species Mycoplasma pneumoniae. The symptoms include chest pain, chills, dry cough which is not bloody, excessive sweating, fever, headache and sore throat." ;
    :has_exact_synonym "Mycoplasma pneumonia"@en,
        "Mycoplasmal pneumonia"@en,
        "Pneumonia due to Eaton's agent"@en,
        "Pneumonia due to Mycoplasma pneumoniae"@en,
        "Pneumonia due to Mycoplasma pneumoniae (disorder)"@en,
        "cold agglutinin positive pneumonia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rift_valley_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hematemesis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hematochezia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :jaundice ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :menorrhagia ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :rift_valley_fever_virus ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in infection, has_material_basis_in Rift Valley fever virus, which is transmitted_by Aedes mosquitoes. The virus affects domestic animals (cattle, buffalo, sheep, goats, and camels) and humans. The infection has_symptom jaundice, has_symptom vomiting blood, has_symptom passing blood in the feces, has_symptom ecchymoses (caused by bleeding in the skin), has_symptom bleeding from the nose or gums, has_symptom menorrhagia and has_symptom bleeding from venepuncture sites." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intestinal_tuberculosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bleeding ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :gastrointestinal_bleeding ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :intestine ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        :gastrointestinal_tuberculosis,
        :intestinal_disease ;
    :has_definition "A gastrointestinal tuberculosis that involves diffuse mucosal fold thickening, formation of ulcers and fistulae located_in intestine. The infection has_symptom abdominal pain, has_symptom gastrointestinal bleeding, has_symptom nausea and has_symptom vomiting." ;
    :has_exact_synonym "tuberculosis of intestine"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:crater_like_holes_of_optic_disc rdfs:subClassOf :visual_pathway_disease ;
    :has_exact_synonym "Crater-like optic disc holes"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vaginal_mullerian_papilloma rdfs:subClassOf :vaginal_benign_neoplasm ;
    :has_definition "A vaginal benign neoplasm that presents in childhood and is considered to be of Mullerian origin." ;
    :has_exact_synonym "vaginal Muellerian papilloma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:scheuermann_s_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :vertebral_column ],
        :osteochondrosis,
        :spinal_disease ;
    :has_definition "An osteochondrosis that results_in abnormal bone growth and curvature located_in thoracic vertebral column." ;
    :has_exact_synonym "Juvenile osteochondritis of the spine"@en,
        "Juvenile osteochondrosis of Scheurermann"@en,
        "Juvenile osteochondrosis of spine"@en,
        "Scheuermann's kyphosis"@en,
        "Sherman's Disease"@en ;
    :has_narrow_synonym "Scheuermann disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diphtheritic_cystitis rdfs:subClassOf :cystitis ;
    :has_definition "A cystits which involves inflammation and formation of a dense fibrous false membrane on the mucous membrane of the bladder." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diphtheritic_peritonitis rdfs:subClassOf :peritonitis ;
    :has_definition "A peritonitis which involves inflammation of peritoneal cavity by Corynebacterium diphtheriae." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:exocrine_pancreatic_insufficiency rdfs:subClassOf :pancreas_disease ;
    :has_definition "A pancreas disease that is characterized by the inability of the exocrine pancreas to produce and secrete an adequate amount of digestive enzymes into the small intestine." ;
    :has_exact_synonym "EPI" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hyperinsulinemic_hypoglycemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_blood_glucose_concentration ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :hypoglycemia ],
        :hypoglycemia ;
    :has_definition "A carbohydrate metabolic disorder that involves low blood glucose resulting from an excess of insulin." ;
    :has_exact_synonym "Islet cell hyperplasia"@en,
        "nesidioblastosis"@en,
        "persistent hyperinsulinemia hypoglycemia of infancy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anatomical_narrow_angle_borderline_glaucoma rdfs:subClassOf :borderline_glaucoma ;
    :has_definition "A borderline glaucoma characterized by an anatomically narrow anterior chamber angle with or without additional clinical features and risk factors associated with high likelihood of developing glaucomatous optic atrophy in the future. These additional features may include elevated intraocular pressure, retinal nerve fiber layer abnormalities, abnormal anterior chamber angles, and/or a positive family history for glaucoma without any evidence of current optic nerve atrophy." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diabetic_cataract rdfs:subClassOf :cataract ;
    :has_definition "A cataract that is characterized by loss of lens transparency secondary to hyperglycemia related to diabetes mellitus." ;
    :has_exact_synonym "Cataract - diabetic"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypertrophy_of_tongue_papillae rdfs:subClassOf :tongue_disease ;
    :has_exact_synonym "Tongue papillary hypertrophy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_toxoplasmosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :placental_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :physical_disorder,
        :toxoplasmosis ;
    :has_definition "A toxoplasmosis that involves a reactivated infection of the mother transmitted to the fetus during pregnancy. Spontaneous abortion and stillbirth may occur." ;
    :has_exact_synonym "Toxoplasmosis - congen."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:laryngeal_cartilage_cancer rdfs:subClassOf :larynx_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :laryngeal_cartilage ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "malignant neoplasm of laryngeal cartilage"@en,
        "malignant neoplasm of laryngeal cartilages"@en,
        "malignant tumor of laryngeal cartilage"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pedophilia rdfs:subClassOf :paraphilia_disorder ;
    :has_exact_synonym "Paedophilia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ego_dystonic_sexual_orientation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anxiety ],
        :sexual_health_disorder ;
    :has_definition "A sexual health disorder that is characterized by having a sexual orientation or an attraction that is at odds with one's idealized self-image, causing anxiety and a desire to change one's orientation or become more comfortable with one's sexual orientation." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:senile_ectropion rdfs:subClassOf :ectropion ;
    :has_exact_synonym "Involutional ectropion"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chondromalacia_patellae rdfs:subClassOf :bone_disease,
        :chondromalacia ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :chondromalacia ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :patella ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Chondromalacia of patella"@en,
        "softening of articular cartilage of patella"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome rdfs:subClassOf :collagen_disease ;
    :has_definition "A collagen disease that is characterized by extremely flexible joints, elastic skin, and excessive bruising caused by a heritable defect in collagen synthesis, which leads to marked healing difficulties. EDS has five cardinal signs, which may be present to some degree in all of the subtypes. These five cardinal signs are skin fragility, blood vessel fragility, skin hyperelasticity, joint hypermobility, and characteristic subcutaneous nodules." ;
    :has_exact_synonym "Cutis hyperelastica"@en,
        "elastic skin"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:reading_disorder rdfs:subClassOf :learning_disability ;
    :has_definition "A learning disability involing difficulty reading resulting primarily from neurological factors which affect any part of the reading process." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stiff_person_syndrome rdfs:subClassOf :movement_disease ;
    :has_definition "A movement disease that is of unknown etiology characterized by progressive rigidity." ;
    :has_exact_synonym "Stiff-man syndrome"@en,
        "stiff man syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tinea_profunda rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abscess ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :trichophyton_mentagrophytes ],
        :tinea_corporis ;
    :has_definition "A tinea corporis that results_in fungal infection located_in skin, has_material_basis_in Trichophyton mentagrophytes and results_in_formation_of subcutaneous abscesses." ;
    :has_exact_synonym "Deep seated dermatophytosis"@en,
        "Granuloma trichophyticum"@en,
        "Majocchi's granuloma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tinea_manuum rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :zone_of_skin ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_desquamation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :itching ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :paresthesia ],
        :dermatophytosis,
        :skin_disease ;
    :has_definition "A dermatophytosis that results_in fungal skin infection located_in hand, has_material_basis_in Ascomycota fungi that belong to a group called dermatophytes and has_symptom itching, has_symptom burning, has_symptom cracking, and has_symptom scaling." ;
    :has_exact_synonym "Dermatophytosis of hand"@en,
        "Tinea manus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:scrub_typhus rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :orientia_tsutsugamushi ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :insect_borne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :eschar ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :leptotrombidium_deliense ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :splenomegaly ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :maculopapular_rash ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        :typhus ;
    :has_definition "A typhus that has_material_basis_in Orientia tsutsugamushi, which is transmitted by trombiculid mites (Leptotrombidium deliense). The infection has symptom fever, has symptom headache, has symptom muscle pain, has symptom cough, has symptom maculopapular rash, has symptom eschar, has symptom splenomegaly and has symptom lymphadenopathy." ;
    :has_exact_synonym "Japanese river fever"@en,
        "Kedani fever"@en,
        "Scrub mite-borne typhus"@en,
        "Tsutsugamushi"@en,
        "Tsutsugamushi disease"@en ;
    :has_related_synonym "Chigger-borne rickettsiosis"@en,
        "Chigger-borne typhus"@en,
        "Mite-borne rickettsiosis"@en,
        "Mite-borne typhus"@en,
        "Scrub (mite-borne) typhus"@en,
        "Tropical typhus"@en,
        "Tsutsugamushi fever"@en,
        "Typhus fever due to Rickettsia tsutsugamushi"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:alpha_1_antitrypsin_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onClass [ owl:intersectionOf [ rdf:first :loss_of_function_variant ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onClass :gene ;
                                            owl:onProperty :disease_has_location ;
                                            owl:qualifiedCardinality "1"^^xsd:nonNegativeInteger ] ;
                                    rdf:rest :nil ] ] ] ;
            owl:onProperty :has_material_basis_in ;
            owl:qualifiedCardinality "1"^^xsd:nonNegativeInteger ],
        :plasma_protein_metabolism_disease ;
    :has_definition "A plasma protein metabolism disease that has_material_basis_in defective production of the protease inhibitor alpha 1-antitrypsin (A1AT), leading to decreased A1AT activity in the blood and lungs, and deposition of excessive abnormal A1AT protein in liver cells." ;
    :has_exact_match "MESH:D019896" ;
    :has_exact_synonym "AAT deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fibrodysplasia_ossificans_progressiva rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :connective_tissue_disease ;
    :has_definition "A connective tissue disease that is characterized by progressive ossification of skeletal muscle, fascia, tendons, and ligaments and has_material_basis_in heterozygous mutation in the ACVR1 gene." ;
    :has_exact_synonym "Stone Man Syndrome"@en,
        "myositis ossificans progressiva"@en,
        "progressive myositis ossificans"@en,
        "progressive ossifying myositis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:temporal_arteritis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_immunoglobulin_level ],
        :autoimmune_disease_of_cardiovascular_system,
        :autoimmune_disease_of_central_nervous_system,
        :central_nervous_system_vasculitis ;
    :has_definition "A central nervous system vasculitis that is characterized by inflammation of the lining of arteries, often arteries in the head." ;
    :has_exact_synonym "Horton's disease"@en,
        "giant cell arteritis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kawasaki_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lymph_gland_swelling ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :vasculitis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :conjunctival_congestion ],
        :lymphadenitis ;
    :has_definition "A lymphadenitis characterized by swelling of cervical lymph nodes in infants and young children and inflammation of medium-sized blood vessels located_in body, has_symptom fever, has_symptom congestion of ocular conjunctivae, has_symptom reddening of lips, has_symptom reddening of oral cavity, has_symptom protuberance of tongue papillae and has_symptom edema of extremities." ;
    :has_exact_synonym "Kawasaki's disease"@en,
        "MLNS"@en,
        "acute febrile MCLS"@en,
        "acute febrile mucocutaneous lymph node syndrome"@en,
        "mucocutaneous lymph node syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_dyserythropoietic_anemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :congenital_hemolytic_anemia ;
    :has_definition "A congenital hemolytic anemia characterized by ineffective erythropoiesis, and resulting from a decrease in the number of red blood cells (RBCs) in the body and a less than normal quantity of hemoglobin in the blood." ;
    :has_exact_synonym "congenital dyshaematopoietic anaemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pernicious_anemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :glossitis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :paresthesia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dyspnea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pallor ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :ataxia ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :anemia ],
        :nutritional_deficiency_disease ;
    :has_definition "A nutritional deficiency disease that is characterized by a decrease in red blood cells due to malabsorption of vitamin B12, has_symptom fatigue, pallor, shortness of breath, glossitis, ataxia, and/or paresthesia, has_material_basis_in atrophic gastritis, autoimmune disorder affecting the production or function of intrinsic factor, and/or genetic factors." ;
    :has_exact_synonym "ANEMIA PERNICIOUS"@en,
        "Addison's anaemia"@en,
        "Biermer's anaemia"@en,
        "Biermer's anemia"@en,
        "pernicious anaemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:megaloblastic_anemia rdfs:subClassOf :macrocytic_anemia ;
    :has_definition "A macrocytic anemia that is characterized by inhibition of DNA synthesis during red blood cell production." ;
    :has_exact_synonym "Grasbeck-Imerslund syndrome"@en,
        "Imerslund-Grasbeck syndrome"@en,
        "MGA1 Norwegian type"@en,
        "RH-MGA1"@en,
        "megaloblastic anaemia"@en,
        "recessive hereditary megaloblastic anaemia 1"@en,
        "recessive hereditary megaloblastic anemia 1"@en ;
    :has_related_synonym "IGS"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gastrointestinal_anthrax rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_appetite ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hematemesis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :severe_diarrhea ],
        :anthrax_disease,
        :gastrointestinal_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :anthrax_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :digestive_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An anthrax disease that results in infection located in mucosa of gastrointestinal tract, has_material_basis_in Bacillus anthracis, which is transmitted by ingestion of anthrax-infected meat. The infection has symptom lesions, has symptom vomiting of blood, has symptom severe diarrhea, has symptom loss of appetite." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:labia_majora_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :labium_majora ],
        :skin_cancer,
        :vulva_carcinoma ;
    :has_definition "A vulva carcinoma that is located_in the labia majora." ;
    :has_exact_synonym "Labia Majora cancer"@en ;
    :has_related_synonym "carcinoma of labia majora"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diamond_blackfan_anemia rdfs:subClassOf :congenital_hypoplastic_anemia ;
    :has_definition "A congenital hypoplastic anemia that is characterized by anemia (low red blood cell counts) with decreased erythroid progenitors in the bone marrow and has_material_basis_insufficient levels of red blood cells due to bone marrow dysfunction." ;
    :has_exact_synonym "Blackfan - Diamond syndrome"@en,
        "chronic constitutional pure red cell anaemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:color_blindness rdfs:subClassOf :blindness ;
    :has_definition "A blindness that is characterized by the inability or decreased ability to see color, or perceive color differences, under normal lighting conditions." ;
    :has_exact_synonym "BLINDNESS COLOR"@en,
        "Colour blindness"@en,
        "Colour vision deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vaginal_glandular_tumor rdfs:subClassOf :vaginal_cancer ;
    :has_definition "A vaginal cancer that has_material_basis_in glandular tissue." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pure_red_cell_aplasia rdfs:subClassOf :aplastic_anemia ;
    :has_exact_synonym "Red cell hypoplasia"@en,
        "primary red cell aplasia"@en,
        "pure red cell aplasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:skin_sarcoidosis rdfs:subClassOf :sarcoidosis,
        :skin_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :sarcoidosis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :zone_of_skin ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Cutaneous sarcoid"@en,
        "cutaneous sarcoidosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neurosarcoidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :cranial_nerve_palsy ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :polyneuropathy ],
        :sarcoidosis ;
    :has_definition "A sarcoidosis that is characterized by involvement of the nervous symptom with cranial nerve palsy, diffuse meningeal disease, acute polyneuropathy, myelitis, or hypothalamic pituitary axis malformation, develops_from a type IV hypersensitivity reaction with noncaseating granulomas involving the nervous system." ;
    :has_exact_synonym "cerebral sarcoidosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:uveoparotid_fever rdfs:subClassOf :sarcoidosis ;
    :has_definition "A sarcoidosis that is characterized by unilateral facial nerve palsy, parotid gland enlargement, anterior uveitis, and low grade fever, and develops_from a type IV hypersensitivity reaction with noncaseating granulomatous infiltration of especially the parotid glands which compresses the facial nerve." ;
    :has_exact_synonym "Heerfordt's syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cardiac_sarcoidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :heart_failure ],
        :sarcoidosis ;
    :has_definition "A sarcoidosis that is characterized by conduction abnormalities, arrhythmias, and congestive heart failure with noncaseating granulomas present on endomyocardial biopsy, and develops_from a type IV hypersensitivity reaction with noncaseating granulomas infiltrating the myocardial tissue, especially that of the left ventricle." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pulmonary_sarcoidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chronic_cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dyspnea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :wheezing ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lymphadenopathy ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :lung ],
        :lung_disease,
        :sarcoidosis ;
    :has_definition "A sarcoidosis that is characterized by noncaseating granulomatous infiltration of the lungs and supporting lymph nodes, bilateral hilar adenopathy, and pulmonary issues, has_symptom shortness of breath, fatigue, wheezing, and chronic cough, and develops_from a type IV hypersensitivity reaction." ;
    :has_exact_synonym "lung Sarcoidosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hepatic_encephalopathy rdfs:subClassOf :brain_disease ;
    :has_definition "A brain disease that is characterized by loss of brain function, the occurrence of confusion, altered level of consciousness, and coma that results when the liver is unable to remove toxins from the blood." ;
    :has_exact_synonym "Portal-systemic encephalopathy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alexia rdfs:subClassOf :agnosia ;
    :has_definition "An agnosia that is a loss of the ability to recognize text." ;
    :has_exact_synonym "Aphemesthaesia"@en,
        "acquired dyslexia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_hypoplastic_anemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :aplastic_anemia,
        :physical_disorder ;
    :has_exact_synonym "congenital aplastic anaemia"@en,
        "congenital aplastic anemia"@en,
        "congenital hypoplastic anaemia"@en ;
    :has_related_synonym "Constitutional aplastic anaemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:urethritis rdfs:subClassOf :urethral_disease ;
    :has_exact_synonym "Non-Gonococcal Urethritis"@en,
        "Nongonococcal urethritis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bejel rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :contact_transmission ;
                            rdf:rest [ rdf:first :vehicle_borne_fomite_transmission ;
                                    rdf:rest :nil ] ] ] ],
        [ owl:unionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :zone_of_skin ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :oral_cavity ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :disease_has_location ;
                                            owl:someValuesFrom :bone_element ] ;
                                    rdf:rest :nil ] ] ] ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results in infection located in mucosa of mouth, located in skin or located in bone, has_material_basis_in Treponema pallidum subsp endemicum, which is transmitted by contact or transmitted by sharing of domestic utensils. The infection has symptom moist patches in the mouth, has symptom lumps in long bones, tissues around the mouth, nose, and roof of the mouth. These lumps destroy tissue, causing bones to be deformed and disfiguring the face." ;
    :has_exact_synonym "Njovera"@en,
        "Nonvenereal endemic syphilis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glanders rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_tightness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chest_pain ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results in septicemic infection, has_material_basis_in Burkholderia mallei, which is transmitted by contact with tissues or body fluids of infected animals, or through mucosal surfaces such as the eyes and nose. The infection has symptom fever, has symptom chills, has symptom sweating, has symptom muscle aches, has symptom chest pain, has symptom muscle tightness, has symptom headache, has symptom mucopurulent nasal discharge, and has symptom nodular lesions in the lungs." ;
    :has_exact_synonym "Farcy pipes"@en,
        "Infection due to Pseudomonas mallei"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:basilar_artery_occlusion rdfs:subClassOf :artery_disease,
        :occlusion_precerebral_artery ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :occlusion_precerebral_artery ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :basilar_artery ] ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:corneal_argyrosis rdfs:subClassOf :corneal_disease ;
    :has_exact_synonym "Argentous corneal deposits"@en,
        "Argyrosis of cornea"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

