@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:progressive_peripheral_pterygium rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_vision ],
        :conjunctival_pterygium ;
    :has_definition "A conjunctival pterygium that is characterized by progressive (as opposed to quiescent) fleshy outpouching of conjunctival growth and has_symptom fleshy bumps on the surface of the eye, foreign body sensation, decreased vision, and astigmatism. Progressive peripheral pterygiums are more common in people prone to ocular surface injury, such as those living in sunny, hot, and dry climates. Progressive peripheral pterygiums progress from pinguecula." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
