:tuberous_sclerosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :loss_of_function_variant ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:minQualifiedCardinality "1"^^xsd:nonNegativeInteger ;
                                            owl:onClass :gene ;
                                            owl:onProperty :disease_has_location ] ;
                                    rdf:rest :nil ] ] ] ],
        :autosomal_dominant_disease,
        :syndrome ;
