    :has_exact_synonym "Bourneville's disease"@en,
        "Epiloia"@en,
        "Tuberose sclerosis"@en,
        "Tuberous sclerosis syndrome"@en,
        "cerebral sclerosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
