            owl:someValuesFrom :exhaustion ],
        :tetanus ;
    :has_definition "A tetanus that occurs in newborn babies when the birth cord stump gets dirty through cutting it with an unclean blade or applying substances containing bacteria to it. The infection has symptom stiff body, has symptom muscle spasms, has symptom difficulty in breathing, and has symptom exhaustion." ;
    :has_exact_synonym "neonatal tetanus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:loiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abscess ],
        [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :zone_of_skin ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :eye ] ;
                            rdf:rest :nil ] ] ],
        :eye_disease,
        :filariasis,
        :skin_disease ;
    :has_definition "A filariasis that involves parasitic infection of the skin and eyes caused by the nematode Loa loa, which is transmitted through the bite of a deer fly or mango fly. The disease is characterized by episodic angioedema in the arms and legs, and cyst-like enlargements of the connective tissue around the sheaths of muscle tendons. Dead worms may cause chronic abscesses, which may lead to the formation of granulomatous reactions and fibrosis." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:osteopetrosis rdfs:subClassOf :osteosclerosis ;
    :has_definition "An osteosclerosis that has_material_basis_in lack of bone resorption which results_in abnormally hard and brittle bones." ;
    :has_exact_synonym "Albers-Schonberg disease"@en,
        "marble bone"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:purulent_labyrinthitis rdfs:subClassOf :labyrinthitis ;
    :has_definition "A labyrinthitis which is a bacterial infectious disease of the inner ear, often causing deafness and loss of vestibular function. This is caused when bacteria spread to the inner ear during the course of severe acute otitis media, purulent meningitis, or an enlarging cholesteatoma." ;
    :has_exact_synonym "Suppurative labyrinthitis"@en,
        "bacterial labyrinthitis"@en ;
    :has_related_synonym "acute suppurative labyrinthitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

