@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:low_tension_glaucoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :ocular_hypertension ],
        :open_angle_glaucoma ;
    :has_definition "An open-angle glaucoma characterized by increased intrinsic resistance to aqueous outflow without known secondary causes, an anatomically narrow anterior chamber angle, or elevated intraocular pressure compared to the average population. Normal tension glaucoma has_symptom progressive decreased vision and progressive loss of peripheral vision." ;
    :has_exact_synonym "Normal tension glaucoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:secondary_parkinson_disease rdfs:subClassOf :neurodegenerative_disease ;
    :has_exact_synonym "Symptomatic parkinsonism"@en,
        "disorder presenting primarily with parkinsonism"@en,
        "secondary parkinsonism"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:interval_angle_closure_glaucoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :acute_pain ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :ocular_hypertension ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloodshot_eye ],
        :primary_angle_closure_glaucoma ;
    :has_definition "A primary angle-closure glaucoma characterized by acute closure of the anterior chamber angle by an intrinsic defect such that aqueous outflow is blocked and the intraocular pressure becomes suddenly inappropriately elevated threatening optic nerve damage and visual field loss; but that typically resolves spontaneously after several hours, even though it may recur. Interval angle-closure glaucoma has_symptom sudden pain, redness, headache, and blurry vision with haloes around lights that resolves spontaneously. Interval angle-closure glaucoma can be caused by exacerbation of chronic primary angle-closure glaucoma, typically by a medication or state that dilates the eyes and thus narrows the anterior chamber angle, blocking any aqueous outflow." ;
    :has_exact_synonym "Angle-closure glaucoma, subacute"@en,
        "Intermittent angle-closure glaucoma"@en,
        "Prodromal angle closure glaucoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paranasal_sinus_lymphoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :lymphocyte ],
        :lymphoma,
        :paranasal_sinus_cancer ;
    :has_exact_synonym "Lymphoma of Accessory sinus"@en,
        "lymphoma of paranasal sinus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:angle_closure_glaucoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :ocular_hypertension ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_vision ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloodshot_eye ],
        :glaucoma ;
    :has_definition "A glaucoma characterized by closure of the anterior chamber angle such that aqueous outflow is blocked and the intraocular pressure becomes inappropriately elevated leading to optic nerve damage and visual field loss. Angle-closure glaucoma has_symptom progressive peripheral vision loss, decreased vision, and pain, redness, and headache in acute cases. Angle closure glaucoma can be caused by anatomically narrow angle, injury to the trabecular meshwork, and injuries to the anterior chamber, such as neovascularization and uveitis." ;
    :has_exact_synonym "ACG - Angle-closure glaucoma"@en,
        "Angle Closure Glaucoma"@en,
        "Closed angle glaucoma"@en,
        "Narrow cleft glaucoma"@en,
        "primary open-angle glaucoma with narrow angles"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

