        :nervous_system_disease ;
    :has_definition "An aspergillosis that involves fungal infection of the central nervous system in immunocompromised patients caused by Aspergillus, presenting as a space-occupying lesion." ;
    :has_exact_match "MESH:D020953" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
