@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:opisthorchiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :constipation ],
        [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :pancreas ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :liver ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :disease_has_location ;
                                            owl:someValuesFrom :gallbladder ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dyspepsia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :cholangitis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hepatomegaly ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :cholecystitis ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :opisthorchis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :left_upper_quadrant_abdominal_rigidity ],
        :gallbladder_disease,
        :liver_disease,
        :pancreas_disease,
        :parasitic_helminthiasis_infectious_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves parasitic infection of the liver, pancreas and gall bladder by Opisthorchis viverrini or Opisthorchis felineus. The symptoms include dyspepsia, abdominal pain, diarrhea, constipation, hepatomegaly, cholangitis, cholecystitis, and cholangiocarcinoma." ;
    :has_exact_synonym "Infection by Opisthorchis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:addison_s_disease rdfs:subClassOf :adrenal_cortical_hypofunction ;
    :has_definition "An adrenal cortical hypofunction that is characterized by insufficient steroid hormone production by the adrenal glands." ;
    :has_exact_synonym "Addison disease"@en,
        "Addison disease, chronic adrenal insufficiency"@en,
        "HYPOADRENOCORTICISM, FAMILIAL"@en,
        "primary adrenocortical insufficiency"@en,
        "primary hypoadrenalism"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plantar_wart rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :human_papillomavirus_types ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_lesion ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in benign epithelial tumors located_in skin of the sole or toes of the foot, has_material_basis_in human papillomavirus (types 1, 2, 4 or 63), has_symptom lesions that appear on the sole of the foot." ;
    :has_exact_synonym "Verruca plantaris"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epidermodysplasia_verruciformis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease that results_in skin squamous cell carcinoma located_in skin, associated with a high risk of carcinoma. It is characterized by abnormal susceptibility to human papillomaviruses of the skin and has_symptom lesions on the body." ;
    :has_exact_match "MESH:D004819" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chancroid rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :zone_of_skin ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :_haemophilus_ducreyi ],
        :primary_bacterial_infectious_disease,
        :skin_disease ;
    :has_definition "A primary bacterial infectious disease that is a sexually transmitted infection located in skin of the genitals, has_material_basis_in Haemophilus ducreyi, which is transmitted by sexual contact. The infection has symptom painful and soft ulcers." ;
    :has_exact_synonym "Ulcus molle, skin"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypermobility_syndrome rdfs:subClassOf :arthropathy ;
    :has_exact_synonym "benign joint hypermobility"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:localized_anterior_staphyloma rdfs:subClassOf :scleral_staphyloma ;
    :has_exact_synonym "Anterior staphyloma, localised"@en,
        "Anterior staphyloma, localized"@en,
        "localised anterior staphyloma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_tympanitis rdfs:subClassOf :tympanic_membrane_disease ;
    :has_exact_synonym "acute myringitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myringitis_bullosa_hemorrhagica rdfs:subClassOf :tympanic_membrane_disease ;
    :has_definition "A tympanic membrane disease that is characterized by blisters on the eardrum resulting from infection." ;
    :has_exact_synonym "Bullous myringitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:female_breast_central_part_cancer rdfs:subClassOf :female_breast_cancer ;
    :has_definition "A female breast cancer that is located_in the center of the breast." ;
    :has_exact_synonym "malignant neoplasm of central part of female breast"@en,
        "malignant neoplasm of central portion of female breast"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vaginal_squamous_tumor rdfs:subClassOf :vaginal_cancer ;
    :has_definition "A vaginal cancer that has_material_basis_in squamous tissue." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endometrial_cancer rdfs:subClassOf :endometriosis,
        :uterine_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :endometrium ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A uterine cancer that is located_in tissues lining the uterus." ;
    :has_exact_synonym "endometrial Ca"@en,
        "endometrial neoplasm"@en,
        "malignant endometrial neoplasm"@en,
        "malignant neoplasm of endometrium"@en,
        "neoplasm of endometrium"@en,
        "primary malignant neoplasm of endometrium"@en,
        "tumor of Endometrium"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:inclusion_conjunctivitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :conjunctival_swelling ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :chlamydia_trachomatis ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :conjunctiva ],
        :commensal_bacterial_infectious_disease,
        :conjunctival_disease ;
    :has_definition "A commensal bacterial infectious disease that results_in inflammation, located_in conjunctiva of the eye, has_material_basis_in Chlamydia trachomatis, which is transmitted_by sexual contact. The infection has_symptom swollen conjunctiva and eyelids and has_symptom discharge of pus and mucus." ;
    :has_exact_synonym "Chlamydial conjunctivitis"@en,
        "Inclusion blennorrhoea"@en,
        "adult inclusion conjunctivitis"@en,
        "inclusion blenorrhea"@en ;
    :has_related_synonym "Paratrachoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pharyngoconjunctival_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :droplet_spread_transmission ;
                            rdf:rest [ rdf:first :vehicle_borne_fomite_transmission ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lymphadenopathy ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :human_adenovirus_7 ;
                            rdf:rest [ rdf:first :human_adenovirus_b3 ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :enlargement_of_lymph_nodes ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :conjunctiva ;
                            rdf:rest [ rdf:first :pharynx ;
                                    rdf:rest :nil ] ] ] ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results in infection located in pharynx or located in conjunctiva, has_material_basis_in Human adenovirus 3 or has_material_basis_in Human adenovirus 7, which are transmitted by droplet spread of respiratory secretions or transmitted by fomites. The infection has symptom fever, has symptom lymphadenopathy of the neck, and has symptom headache." ;
    :has_exact_synonym "Adenoviral pharyngoconjunctivitis"@en,
        "pharyngo-conjunctival fever"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_combined_hyperlipidemia rdfs:subClassOf :familial_hyperlipidemia ;
    :has_exact_synonym "familial multiple lipoprotein-type hyperlipidemia"@en,
        "hyperbetalipoproteinemia with prebetalipoproteinemia"@en,
        "mixed hyperlipidaemia"@en,
        "type IIb hyperlipoproteinemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fox_fordyce_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :papule ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hair_loss ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :acanthosis_nigricans ],
        :sweat_gland_disease ;
    :has_definition "A sweat gland disease that is characterized by dilatation of the follicular infundibulum with hyperkeratosis, acanthosis, and spongiosis with perifollicular inflammation leading to hair loss and has_symptom flesh colored papules with hair loss and pruritis, especially of the axilla." ;
    :has_exact_synonym "Fox Fordyce disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_hypercholesterolemia rdfs:subClassOf :familial_hyperlipidemia ;
    :has_definition "A familial hyperlipidemia characterized by very high levels of low-density lipoprotein (LDL) and early cardiovascular disease." ;
    :has_exact_synonym "Fredrickson type IIa hyperlipoproteinemia"@en,
        "Fredrickson type IIa lipidaemia"@en,
        "familial hyperbetalipoproteinaemia"@en,
        "familial hypercholesteremia"@en,
        "hyperbetalipoproteinemia"@en,
        "type II hyperlipidemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_subinvolution_of_uterus rdfs:subClassOf :uterine_disease ;
    :has_definition "A uterine disease that is characterized by the inability of the uterus to return to its pre-gestational size after pregnancy." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adhesions_of_uterus rdfs:subClassOf :uterine_disease ;
    :has_definition "A uterine disease that is characterized by the presence of scar tissue which attaches the uterus to another structure." ;
    :has_exact_synonym "Band of uterus"@en,
        "Intrauterine adhesions"@en,
        "Intrauterine synechiae"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypoglossal_nerve_disease rdfs:subClassOf :glossopharyngeal_nerve_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :hypoglossal_nerve ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A glossopharyngeal nerve disease that is located_in the hypoglossal nerve (twelfth cranial nerve)." ;
    :has_exact_synonym "disorder of 12th nerve"@en,
        "disorder of XII nerve"@en,
        "disorder of hypoglossal [12th] nerve"@en,
        "disorder of hypoglossal nerve"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lymphogranuloma_venereum rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abscess ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lymphangitis ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :contact_transmission ;
                            rdf:rest [ rdf:first :vehicle_borne_fomite_transmission ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :chlamydia_trachomatis ],
        :commensal_bacterial_infectious_disease,
        :granuloma_inguinale ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :granuloma_inguinale ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :lymph ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A commensal bacterial infectious disease that results_in infection located_in lymph nodes, has_material_basis_in Chlamydia trachomatis, which is transmitted_by sexual contact, and transmitted_by fomites. The infection has_symptom inguinal lymphadenitis, has_symptom abscesses in the groin area, and has_symptom lymphangitis." ;
    :has_exact_synonym "Climatic or tropical bubo"@en,
        "Durand-Nicolas-Favre disease"@en,
        "Lymphogranuloma inguinale"@en,
        "Poradenitis inguinale"@en,
        "Strumous bubo"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:miliaria rdfs:subClassOf :sweat_gland_disease ;
    :has_definition "A sweat gland disease that is characterized by blocked eccrine sweat glands and ducts." ;
    :has_exact_synonym "eccrine miliaria"@en,
        "heat rash"@en,
        "sweat rash"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tetanic_cataract rdfs:subClassOf :cataract ;
    :has_definition "A cataract resulting from hypocalcemia." ;
    :has_exact_synonym "Hypocalcaemic cataract"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:parasitic_eyelid_infestation rdfs:subClassOf :blepharitis ;
    :has_exact_synonym "Parasitic infestation of eyelid"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sweat_gland_disease rdfs:subClassOf :skin_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :sweat_gland ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A skin disease located_in the sweat glands." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:patent_ductus_arteriosus rdfs:subClassOf :congenital_heart_disease ;
    :has_exact_synonym "Patent ductus Botalli"@en ;
    :has_related_synonym "ductus arteriosus, Patent"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:abetalipoproteinemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :hypolipoproteinemia ;
    :has_definition "A hypolipoproteinemia that is characterized by an inablility to fully absorb dietary fats, cholesterol and fat-soluble vitamins, has_material_basis_in an autosomal recessive disorder of lipid metabolism that has_material_basis_in mutation in the microsomal triglyceride transfer protein that catalyzes the transport of lipids and is required in the secretion of BETA-LIPOPROTEINS." ;
    :has_exact_match "MESH:D000012" ;
    :has_exact_synonym "familial hypobetalipoproteinemia"@en,
        "microsomal triglyceride transfer protein deficiency disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:scleroperikeratitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anterior_scleral_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :photophobia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloodshot_eye ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :splitting_of_urinary_stream ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :scleritis ;
    :has_definition "A scleritis that is characterized by inflammation of the anterior sclera and subsequent inflammation of the adjacent cornea and has_symptom pain, red eyes, photophobia, tearing, and blurry vision. Scleroperikeratitis may progress to sclerosing keratitis, which occurs when the inflammation leads to opacification of the anterior corneal stroma and subsequent vision loss. Scleroperikeratitis is caused by severe anterior scleritis that causes inflammation and injury to the adjacent corneal layer. Anterior scleritis can be caused by autoimmune diseases, connective tissue diseases, and infection." ;
    :has_exact_synonym "Scleritis with corneal involvement"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_closed_angle_glaucoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :ocular_hypertension ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :acute_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloodshot_eye ],
        :primary_angle_closure_glaucoma ;
    :has_definition "A primary angle-closure glaucoma characterized by acute closure of the anterior chamber angle by an intrinsic defect such that aqueous outflow is blocked and the intraocular pressure becomes suddenly inappropriately elevated threatening futher optic nerve damage and visual field loss. Acute closed-angle glaucoma has_symptom sudden pain, redness, headache, and blurry vision with haloes around lights. Acute closed-angle glaucoma can be caused by exacerbation of chronic primary angle-closure glaucoma, typically by a medication or state that dilates the eyes and thus narrows the anterior chamber angle, blocking any aqueous outflow." ;
    :has_exact_synonym "acute angle-closure glaucoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:trochlear_nerve_disease rdfs:subClassOf :cranial_nerve_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :trochlear_nerve ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Superior oblique muscle innervation disorder"@en,
        "Trochlear nerve disorder"@en,
        "disorder of trochlear nerve"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_cranial_nerve_palsy rdfs:subClassOf :glossopharyngeal_nerve_disease ;
    :has_exact_synonym "Multiple cranial nerve palsies"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:focal_labyrinthitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :vestibular_labyrinth ],
        :labyrinthitis ;
    :has_definition "A labyrinthitis which is an infectious inflammatory disease of a circumscribed area of either the vestibular or the cochlear portion of the labyrinth, or of both together. This is caused by a chronic suppurative otitis media, mastoiditis, or cholesteatoma." ;
    :has_exact_synonym "Circumscribed labyrinthitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypoactive_sexual_desire_disorder rdfs:subClassOf :psychosexual_disorder ;
    :has_exact_synonym "Lack or loss of sexual desire"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypolipoproteinemia rdfs:subClassOf :lipid_metabolism_disorder ;
    :has_definition "A lipid metabolism disorder that is characterized by unusually low levels of fats in the blood." ;
    :has_exact_synonym "Hypolipoproteinaemia"@en ;
    :has_related_synonym "Lipoprotein deficiencies"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tangier_disease rdfs:subClassOf :hypolipoproteinemia ;
    :has_definition "A hypolipoproteinemia that is characterized by markedly reduced levels of plasma high density lipoproteins resulting in tissue accumulation of cholesterol esters and that has_material_basis_in homozygous or compound heterozygous mutation in the ABCA1 gene on chromosome 9q31." ;
    :has_exact_match "MESH:D013631" ;
    :has_exact_synonym "familial alpha-lipoprotein deficiency"@en,
        "familial high density lipoprotein deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sick_sinus_syndrome rdfs:subClassOf :sinoatrial_node_disease ;
    :has_exact_match "MESH:D012804" ;
    :has_exact_synonym "sinus node infection"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polyneuropathy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :peripheral_muscle_weakness ],
        :peripheral_nervous_system_disease ;
    :has_definition "A peripheral system disease that is characterized by damage affecting peripheral nerves (peripheral neuropathy) in roughly the same areas on both sides of the body, featuring weakness, numbness, pins-and-needles, and burning pain." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bird_fancier_s_lung rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :malaise ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dyspnea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :acute_dyspnea ],
        :extrinsic_allergic_alveolitis ;
    :has_definition "An extrinsic allergic alveolitis which is caused by inhalation of antigens from avian excreta. The disease has_symptom abrupt onset of dyspnea, has_symptom cough, has_symptom malaise, and has_symptom fever, after exposure to antigen." ;
    :has_exact_synonym "Avian hypersensitivity Pneumonitis"@en,
        "Bird-fancier's lung"@en,
        "Bird-fanciers' lung"@en,
        "bird breeder's lung"@en,
        "bird fancier lung"@en,
        "pigeon breeder's lung"@en,
        "poultry worker's lung"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:squamous_cell_papilloma rdfs:subClassOf :papilloma ;
    :has_exact_synonym "Epidermoid papilloma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypobetalipoproteinemia rdfs:subClassOf :hypolipoproteinemia ;
    :has_definition "A hypolipoproteinemia characterized by permanently low levels of apolipoprotein B and LDL cholesterol resulting from an impaired ability to absorb and transport fats." ;
    :has_exact_synonym "Hypo-beta-lipoproteinemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:white_piedra rdfs:subClassOf :superficial_mycosis ;
    :has_definition "A superficial mycosis that is a superficial fungal infection of the hair shaft caused by Trichosporon beigelii. Infected hairs develop soft greyish-white nodules along the shaft." ;
    :has_exact_synonym "Tinea blanca"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:red_green_color_blindness rdfs:subClassOf :color_blindness ;
    :has_exact_synonym "Deutan defect"@en,
        "Deuteranopia"@en,
        "Reduced red-green discrimination"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:norum_disease rdfs:subClassOf :hypolipoproteinemia ;
    :has_exact_synonym "LECITHIN CHOLESTEROL ACYLTRANSFERASE DEFICIENCY"@en,
        "lecithin acyltransferase deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:red_color_blindness rdfs:subClassOf :color_blindness ;
    :has_exact_synonym "Protan defect"@en,
        "Protanopia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:achromatopsia rdfs:subClassOf :color_blindness ;
    :has_definition "A color blindness that is characterized by a congenital cone color vision disorder, the inability to perceive color and to achieve satisfactory visual acuity at high light levels has_material_basis_in autosomal recessive inheritance." ;
    :has_exact_synonym "ACHM"@en,
        "Monochromatism"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lumbosacral_plexus_lesion rdfs:subClassOf :peripheral_nervous_system_disease ;
    :has_exact_synonym "Lumbosacral plexus lesions"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:somatization_disorder rdfs:subClassOf :somatoform_disorder ;
    :has_definition "A somatoform disorder that involves persistently complaints of varied physical symptoms that have no identifiable physical origin." ;
    :has_exact_synonym "Briquet's disorder"@en,
        "Somatisation disorder"@en ;
    :has_related_synonym "Polysomatising disorder"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bacterial_esophagitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :bacteria ],
        :bacterial_infectious_disease,
        :esophagitis .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:eosinophilic_esophagitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :esophagitis ;
    :has_definition "An esophagitis characterized by inflammation involving eosinophils located_in esophagus." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lacrimal_duct_obstruction rdfs:subClassOf :lacrimal_apparatus_disease ;
    :has_exact_synonym "Blocked lacrimal canaliculus"@en,
        "Obstruction of lacrimal canaliculus"@en,
        "Obstruction of lacrimal ducts"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:visual_pathway_disease rdfs:subClassOf :eye_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :optic_tract ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An eye disease that affects the neural pathway from the optic nerve to the visual cortex, through which light is interpreted as an image." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:facial_paralysis rdfs:subClassOf :facial_nerve_disease ;
    :has_exact_synonym "Facial Palsy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amenorrhea rdfs:subClassOf :female_reproductive_system_disease ;
    :has_definition "A female reproductive system disease that is characterized by the absence of menstruation." ;
    :has_exact_match "MESH:D000568" ;
    :has_exact_synonym "absence of menstruation"@en,
        "amenia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:urinary_schistosomiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :urinary_bladder ],
        :bladder_disease,
        :schistosomiasis ;
    :has_definition "A schistosomiasis that involves parasitic infection of the urinary tract caused by a digenetic trematode Schistosoma haematobium causing cystitis, ureteritis, fibrosis of the bladder and haematuria, which can progress to bladder cancer." ;
    :has_exact_synonym "Schistosoma Hematobium Infection"@en,
        "Schistosoma haematobium"@en,
        "Schistosoma hematobium infectious disease"@en,
        "Schistosomiasis due to schistosoma haematobium"@en,
        "Schistosomiasis of bladder"@en,
        "Vesical schistosomiasis"@en,
        "bladder Schistosomiasis"@en,
        "cystitis with bilharziasis"@en ;
    :has_related_synonym "Schistosoma haematobium infection"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:benign_paroxysmal_positional_vertigo rdfs:subClassOf :peripheral_vertigo ;
    :has_definition "A peripheral vertigo that is characterized by episodic vertigo followed by gait imbalance and oscillopsia with profound bilateral vestibular loss despite normal hearing." ;
    :has_exact_synonym "benign recurrent vertigo",
        "benign paroxysmal positional nystagmus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_gonococcal_salpingitis rdfs:subClassOf :acute_salpingitis ;
    :has_exact_synonym "Gonococcal salpingitis, specified as acute"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_gonococcal_prostatitis rdfs:subClassOf :prostatitis ;
