    :has_definition "A leukodystrophy characterized by recurrent subcortical ischemic stroke and cognitive impairment." ;
    :has_exact_synonym "cerebral autosomal dominant arteriopathy with subcortical infarcts and leukoencephalopathy"@en,
        "hereditary multi-infarct dementia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bladder_neck_obstruction rdfs:subClassOf :bladder_disease ;
    :has_exact_synonym "Obstruction of bladder neck or vesicourethral orifice"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

