@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:uterus_interstitial_leiomyoma rdfs:subClassOf :uterine_fibroid ;
    :has_definition "An uterine fibroid that is located within the myometrium." ;
    :has_exact_synonym "Intramural leiomyoma of uterus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:uterine_corpus_myxoid_leiomyoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :body_of_uterus ],
        :uterine_fibroid ;
    :has_definition "An uterine fibroid that is characterized by islands of smooth muscle in myxoid connective tissue that contain large vessels, but do no infiltrative and the absence of atypia or mitotic activity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:uterine_corpus_lipoleiomyoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :body_of_uterus ],
        :uterine_fibroid ;
    :has_definition "An uterine fibroid that is characterized by the presence of adipocytes." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:uterine_corpus_bizarre_leiomyoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :smooth_muscle_cell ],
