    :has_definition "A senile cataract that is characterized by dense white opacification of the lens and milky fluid in the lens capsule such that the dense nucleus of the lens sinks in the surrounding fluid. It is the late stage of senile cataracts and is caused by a multifactorial etiology related to aging." ;
    :has_exact_synonym "hypermature cataract"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

