    :has_definition "An osteochondrodysplasia that has_material_basis_in mutations in the RUNX2 gene which results_in undeveloped or absent located_in clavicle along with delayed closing of fontanels in the located_in skull." ;
    :has_exact_synonym "Marie-Sainton Disease"@en,
        "cleidocranial dysostosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
