@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bipolar_i_disorder rdfs:subClassOf :bipolar_disorder ;
    :has_definition "A bipolar disorder that is characterized by at least one manic or mixed episode." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:phaeohyphomycosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :zone_of_skin ;
                            rdf:rest [ rdf:first :brain ;
                                    rdf:rest [ rdf:first :peritoneal_cavity ;
                                            rdf:rest [ rdf:first :paranasal_sinus ;
                                                    rdf:rest [ rdf:first :lung ;
                                                            rdf:rest :nil ] ] ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :cladosporium ;
                            rdf:rest [ rdf:first :aureobasidium ;
                                    rdf:rest [ rdf:first :alternaria ;
                                            rdf:rest [ rdf:first :phialophora ;
                                                    rdf:rest [ rdf:first :exophiala_dermatitidis ;
                                                            rdf:rest [ rdf:first :phaeoannellomyces ;
                                                                    rdf:rest [ rdf:first :rhinocladiella_mackenziei ;
                                                                            rdf:rest [ rdf:first :cladophialophora_bantiana ;
                                                                                    rdf:rest [ rdf:first :exserohilum ;
                                                                                            rdf:rest :nil ] ] ] ] ] ] ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abscess ],
        :primary_systemic_mycosis ;
    :has_definition "A primary systemic mycosis located_in subcutaneous tissues, located_in brain, located_in sinuses, located_in lungs, or located_in peritoneal cavity, has_material_basis_in Exophiala dermatitidis, has_material_basis_in Phialophora, has_material_basis_in Curvularia hawaiiensis, has_material_basis_in Exserohilum, has_material_basis_in Cladophialophora bantiana, has_material_basis_in Phaeoannellomyces, has_material_basis_in Aureobasidium, has_material_basis_in Cladosporium cladosporoides, has_material_basis_in Alternaria or has_material_basis_in Rhinocladiella mackenziei and results_in_formation_of subcutaneous abscesses arising at the site of minor trauma, and occur in both immunosuppressed and immunocompetent individuals." ;
    :has_exact_synonym "Infection by dematiacious fungi"@en,
        "phaehyphomycosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_angle_closure_glaucoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_vision ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloodshot_eye ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :ocular_hypertension ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        :angle_closure_glaucoma ;
    :has_definition "An angle-closure glaucoma characterized by closure of the anterior chamber angle by an intrinsic defect such that aqueous outflow is blocked and the intraocular pressure becomes inappropriately elevated leading to optic nerve damage and visual field loss. Primary angle-closure glaucoma has_symptom progressive peripheral vision loss, decreased vision, and pain, redness, and headache in acute cases. Primary angle closure glaucoma can be caused by anatomically narrow angle, defects in the trabecular meshwork, and iris abnormalities. Primary angle-closure glaucoma has a strong genetic component." ;
    :has_exact_synonym "primary Angle Closure Glaucoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paraurethral_gland_cancer rdfs:subClassOf :female_reproductive_organ_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :paraurethral_gland ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A female reproductive organ cancer that is located_in the paraurethral glands." ;
    :has_exact_synonym "malignant tumor of paraurethral gland"@en,
        "malignant tumor of the Paraurethral gland"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_poststreptococcal_glomerulonephritis rdfs:subClassOf :glomerulonephritis ;
    :has_exact_synonym "Post-Streptococcal Glomerulonephritis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_diffuse_nephritis rdfs:subClassOf :diffuse_glomerulonephritis ;
    :has_exact_synonym "acute Diffuse Glomerulonephritis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plasmodium_falciparum_malaria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :plasmodium_falciparum ],
        :malaria ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :malaria ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :plasmodium_falciparum ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A malaria described as a severe form of the disease caused by a parasite Plasmodium falciparum, which is marked by irrregular recurrence of paroxysms and prolonged or continuous fever." ;
    :has_exact_synonym "Malaria fever, subtertian"@en,
        "falciparum malaria"@en,
        "malignant tertian fever"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blackwater_fever rdfs:subClassOf :malaria ;
    :has_definition "A malaria that presents as a rare febrile complication of repeated malarial attacks characterized by intravascular haemolysis, haemoglobinuria and kidney failure, resulting from destruction of red blood cells caused by heavy parasitization with Plasmodium falciparum or Plasmodium vivax." ;
    :has_exact_synonym "Black water fever"@en,
        "Hemoglobinuric, malaria"@en,
        "Malarial Hemoglobinuria"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebral_malaria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebrum ],
        :malaria ;
    :has_definition "A malaria that involves neurologic damage resulting from blockage of the blood vessels, caused due to the infection of the red blood cells by Plasmodium species." ;
    :has_exact_synonym "Malarial encephalitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vestibular_nystagmus rdfs:subClassOf :globe_disease ;
    :has_exact_synonym "Nystagmus associated with disorder of the vestibular system"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glucocorticoid_remediable_aldosteronism rdfs:subClassOf :primary_hyperaldosteronism ;
    :has_definition "A primary hyperaldosteronism characterized by variably expressed and severe hypertension, hyperaldosteronism and abnormal adrenal steroid production which improve with exogenous glucocorticoid administration that has_material_basis_in a chimeric gene formed of the CYP11B2 and CYP11B1 genes on chromosome 8q24.3." ;
    :has_exact_synonym "GRA",
        "GRS",
        "familial hyperaldosteronism type I",
        "glucocorticoid-suppressible hyperaldosteronism" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:toxic_labyrinthitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_disease_driver ;
            owl:someValuesFrom :alcohol ],
        :labyrinthitis ;
    :has_definition "A labyrinthitis induced by alcohol, drug ingestion, or occasionally, inhaled substances that are toxic to the inner ear. Drugs like aminoglycosides, furosemide, ethacrynic acid, acetylsalicyclic acid, amiodarone, quinine, cisplatinum, barbiturates, quinine, anti-Alzheimer's medications, anticonvulsants, antidepressants, and anxiolytics can be ototoxic." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epicondylitis rdfs:subClassOf :bone_inflammation_disease ;
    :has_definition "A bone inflammation disease that results_in inflammation located_in epicondyle." ;
    :has_exact_synonym "Lateral epicondylitis"@en,
        "andrel epicondylitis"@en,
        "archer's elbow"@en,
        "golfer's elbow"@en,
        "hockey elbow"@en,
        "medial epicondylitis"@en ;
    :has_related_synonym "shooter's elbow"@en,
        "tennis elbow"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:root_caries rdfs:subClassOf :dental_caries ;
    :has_exact_synonym "Cementum caries"@en,
        "Dental caries of root surface"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_artery_atheroma rdfs:subClassOf :atherosclerosis,
        :renal_artery_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :atherosclerosis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :renal_artery ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Atherosclerosis of renal artery"@en,
        "renal atherosclerosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:boutonneuse_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :eschar ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :rhipicephalus_sanguineus ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :rickettsia_conorii ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :tick_borne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :maculopapular_rash ],
        :spotted_fever ;
    :has_definition "A spotted fever that has_material_basis_in Rickettsia conorii subsp conorii, which is transmitted_by dog tick (Rhipicephalus sanguineus). The infection has_symptom fever, has_symptom eschar (usually single), has_symptom regional adenopathy, has_symptom maculopapular rash on extremities." ;
    :has_exact_synonym "African tick typhus"@en,
        "Rickettsia conorii spotted fever"@en,
        "South African tick-bite fever"@en,
        "kenya tick typhus"@en,
        "marseilles fever"@en ;
    :has_related_synonym "Boutonneuse disease"@en,
        "Conor and Bruch's disease"@en,
        "Kenya fever"@en,
        "Kenyan tick typhus"@en,
        "Mediterranean spotted fever"@en,
        "Mediterranean tick fever"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:infertility_due_to_extratesticular_cause rdfs:subClassOf :male_infertility ;
    :has_exact_synonym "Infertility due to extratesticular causes"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acquired_gastric_outlet_stenosis rdfs:subClassOf :pyloric_stenosis ;
    :has_exact_synonym "acquired hypertrophic pyloric stenosis"@en,
        "adult hypertrophic pyloric stenosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:de_quervain_disease rdfs:subClassOf :arthropathy ;
    :has_exact_synonym "Radial styloid tenosynovitis"@en,
        "Tenosynovitis, de Quervain's"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

