        :large_intestine_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :anus ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A large intestine cancer that is located_in the anus." ;
    :has_exact_synonym "anal cancer"@en,
        "malignant anal tumor"@en .

