@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ovarian_dysfunction rdfs:subClassOf :ovarian_disease ;
    :has_definition "An ovarian disease that is characterized by irregular or absent ovulation." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_anus_melanoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :melanocyte ],
        :anus_cancer,
        :melanoma ;
    :has_exact_synonym "anal melanoma"@en,
        "malignant melanoma of anus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ureterolithiasis rdfs:subClassOf :ureteral_disease ;
    :has_definition "An ureteral disease this is characterized by the formation of stoney concentrations in the ureter." ;
    :has_exact_synonym "Ureteric calculus"@en,
        "Ureteric stone"@en,
        "calculus of ureter"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gyrate_atrophy rdfs:subClassOf :choroid_disease ;
    :has_exact_synonym "Gyrate atrophy of the choroid and/or retina"@en,
        "Ornithinemia with gyrate atrophy"@en,
        "gyrate atrophy of the retina"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

