    :has_exact_synonym "Lymphoma of the Spinal Cord"@en ;
    :has_related_synonym "spinal cord cancer"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spinal_cord_melanoma rdfs:subClassOf [ a owl:Restriction ;
