        :spinal_cancer ;
    :has_exact_synonym "melanoma of the Spinal Cord"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spinal_cord_sarcoma rdfs:subClassOf [ a owl:Restriction ;
