            owl:someValuesFrom :spinal_cord ],
        :sarcoma,
        :spinal_cancer ;
    :has_exact_synonym "sarcoma of the Spinal Cord"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_retrobulbar_neuritis rdfs:subClassOf :optic_neuritis ;
    :has_exact_synonym "Retrobulbar neuritis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bilateral_hyperactive_labyrinth rdfs:subClassOf :labyrinthine_dysfunction ;
    :has_exact_synonym "hyperactive bilateral labyrinthine dysfunction"@en,
        "hyperactive labyrinth, bilateral"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:choroid_disease rdfs:subClassOf :uveal_disease ;
