        "Rheumatic heart failure"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_neurocytoma rdfs:subClassOf :cerebral_ventricle_cancer ;
    :has_exact_synonym "Neurolipocytoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:von_hippel_lindau_disease rdfs:subClassOf :hemangioblastoma ;
    :has_exact_synonym "Hippel Lindau syndrome"@en,
        "von Hippel-Lindau syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:selective_igg_deficiency_disease rdfs:subClassOf :dysgammaglobulinemia ;
    :has_definition "A dysgammaglobulinemia that is characterized by isolated deficiency of an IgG subclass, normal total IgG levels, and subsequent increased susceptibility to recurrent infections, atopic disease, and autoimmune conditions." ;
    :has_exact_synonym "Immunoglobin G subclass deficiency"@en,
        "Selective IgG Immunodeficiency"@en,
        "Selective Immunoglobulin G Subclass deficiency"@en,
        "Selective deficiency of IgG"@en,
        "Selective immunoglobulin G deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_hypogammaglobulinemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :b_cell_deficiency,
        :physical_disorder ;
    :has_exact_synonym "Congenital hypogammaglobulinaemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_agammaglobulinemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :agammaglobulinemia,
        :x_linked_recessive_disease ;
    :has_definition "An agammaglobulinemia that is that has_material_basis_in a mutation in the Bruton's tyrosine kinase (BTK) gene on the X chromosome resulting in X-linked agammaglobulinemia type 1, which is an immunodeficiency characterized by the failure to produce mature B lymphocytes, and associated with a failure of Ig heavy chain rearrangement." ;
    :has_exact_synonym "Bruton disease",
        "BTK deficiency"@en,
        "Bruton agammaglobulinemia tyrosine kinase deficiency"@en,
        "Bruton's Sex-Linked Agammaglobulinemia"@en,
        "Bruton's agammaglobulinaemia"@en,
        "Bruton's type agammaglobulinemia"@en,
        "Bruton-type agammaglobulinemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alcoholic_neuropathy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_disease_driver ;
            owl:someValuesFrom :alcohol ],
        :inflammatory_and_toxic_neuropathy ;
    :has_exact_match "MESH:D020269" ;
    :has_exact_synonym "Alcohol-related polyneuropathy"@en,
        "Alcoholic polyneuropathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:frozen_shoulder rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        :connective_tissue_disease ;
    :has_definition "A connective tissue disease characterized by restriction of both active and passive range of motion located_in the scapulohumeral joint and has_symptom pain and has_symptom restricted range of motion." ;
    :has_exact_synonym "Adhesive capsulitis of shoulder"@en,
        "adhesions-capsulitis,shoulder"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adult_dermatomyositis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :dermatomyositis ;
    :has_exact_synonym "adult onset dermatomyositis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_type_dermatomyositis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :dermatomyositis ;
    :has_exact_synonym "Juvenile dermatomyositis"@en,
        "childhood Dermatomyositis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypophosphatasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_inheritance ],
        :autosomal_genetic_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by disruption of mineralization of bones and teeth that has_material_basis_in mutation in the ALPL gene on chromosome 1p36.12." ;
    :has_exact_synonym "childhood hypophosphatasia"@en,
        "deficiency of alkaline phosphatase"@en,
        "hypophospatasia, childhood"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dihydropyrimidine_dehydrogenase_deficiency rdfs:subClassOf :purine_pyrimidine_metabolic_disorder ;
    :has_definition "A purine-pyrimidine metabolic disorder that is an autosomal recessive metabolic disorder in which there is absent or significantly decreased activity of dihydropyrimidine dehydrogenase, an enzyme involved in the metabolism of uracil and thymine." ;
    :has_exact_synonym "Dihydrouracil Dehydrogenase deficiency"@en,
        "familial pyrimidinaemia"@en,
        "thymine-uracilurea"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_tubular_acidosis rdfs:subClassOf :renal_tubular_transport_disease ;
    :has_definition "A renal tubular transport disease characterized by excess levels of acid in the blood, due to a failure of the kidneys to appropriately acidify the urine." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:abdominal_obesity_metabolic_syndrome_1 rdfs:subClassOf :abdominal_obesity_metabolic_syndrome ;
    :has_definition "An abdominal obesity-metabolic syndrome characterized by insulin resistance and hyperinsulinemia, dyslipidemia, essential hypertension, abdominal obesity, glucose intolerance or noninsulin-dependent diabetes mellitus and an increased risk of cardiovascular events." ;
    :has_exact_synonym "dysmetabolic syndrome X"@en,
        "metabolic syndrome X"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ochronosis rdfs:subClassOf :connective_tissue_disease ;
    :has_definition "A connective tissue disease characterized by bluish-brown discoloration of connective tissues that develops from the deposition of homogentisic acid and subsequent oxidation and polymerization reactions." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tracheal_calcification rdfs:subClassOf :tracheal_disease ;
    :has_exact_synonym "Calcification of trachea"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_frontal_sinusitis rdfs:subClassOf :frontal_sinusitis ;
    :has_definition "A frontal sinusitis which lasts for less than 4 weeks." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:azoospermia rdfs:subClassOf :male_infertility ;
    :has_definition "A male infertility disease characterized by the absence of any measurable level of sperm in semen." ;
    :has_exact_match "MESH:D053713" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oligospermia rdfs:subClassOf :male_infertility ;
    :has_definition "A male fertility issue defined as a low sperm concentration in the ejaculate." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:scleromalacia_perforans rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_vision ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :necrosis ],
        :scleral_disease ;
    :has_definition "A scleral disease that is characterized by a painless severe necrotizing scleritis where the sclera is white, avascular, and thin. The choroid can become exposed leading to infarction and necrosis of related areas; the sclera can also thin such that the dark uvea protrudes through the front of the eye, forming a staphyloma which has_symptom loss of vision and appearance of a dark bulge. Scleromalacia perforans is usually caused by a rare complication of autoimmune disease like rheumatoid arthritis." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gastrointestinal_tularemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lymphadenitis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :malaise ],
        :gastrointestinal_system_disease,
        :tularemia ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :tularemia ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :digestive_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A tularemia that results in formation of ulcerative lesions located in gastrointestinal tract. The infection has symptom fever, has symptom chills, has symptom malaise, has symptom muscle aches, and has symptom vomiting." ;
    :has_exact_synonym "Enteric tularemia"@en,
        "intestinal tularaemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_perichondritis_of_pinna rdfs:subClassOf :perichondritis_of_auricle ;
    :has_definition "A perichondritis of auricle which is persistent and long-lasting." ;
    :has_exact_synonym "chronic pinna perichondritis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cystoid_macular_retinal_degeneration rdfs:subClassOf :degeneration_of_macula_and_posterior_pole ;
    :has_exact_synonym "Cystoid macular degeneration of retina"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_purulent_otitis_media rdfs:subClassOf :suppurative_otitis_media ;
    :has_definition "A suppurative otitis media which is persistent and long-lasting." ;
    :has_exact_synonym "chronic suppurative otitis media"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_atticoantral_disease rdfs:subClassOf :chronic_purulent_otitis_media ;
    :has_definition "A chronic purulent otitis media which involves perforation in the attic region (pars flaccida of the tympanic membrane) or at the posterosuperior margin, with in-growth of squamous epithelium into the middle ear. This is caused as a result of poor ventilation of the middle ear and episodes of infection." ;
    :has_exact_synonym "chronic atticoantral suppurative otitis media"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pyoureter rdfs:subClassOf :ureteral_disease ;
    :has_exact_synonym "Ureter abscess"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:down_syndrome rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :has_material_basis_in ;
                            owl:someValuesFrom :chromosome ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :duplication ] ;
                            rdf:rest :nil ] ] ],
        :chromosomal_duplication_syndrome ;
    :has_definition "A chromosomal disease that is characterized by flat-looking facial features and weak muscle tone (hypotonia) in infancy and is caused by trisomy of all or a critical portion of chromosome 21 and is associated with intellectual disability." ;
    :has_exact_synonym "Complete trisomy 21 syndrome"@en,
        "Down's syndrome"@en,
        "Down's syndrome - trisomy 21"@en,
        "Downs syndrome"@en,
        "G Trisomy"@en,
        "trisomy 21 syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vitreoretinal_dystrophy rdfs:subClassOf :fundus_dystrophy ;
    :has_exact_synonym "Vitreoretinal dystrophies"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adult_onset_still_s_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :rheumatoid_arthritis ;
    :has_definition "A rheumatoid arthritis that is characterized by high fevers, rash, sore throat and joint pain." ;
    :has_exact_synonym "adult onset Still's disease"@en,
        "adult-onset Still disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ureteral_disease rdfs:subClassOf :urinary_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :ureter ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A urinary system disease that is located_in the ureter." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fragile_x_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_dominant_inheritance ],
        :syndrome,
        :x_linked_dominant_disease ;
    :has_definition "A syndrome that is characterized by moderate to severe mental retardation, macroorchidism, and distinct facial features, including long face, large ears, and prominent jaw, and has_material_basis_in X-linked inheritance and a loss of FMR1 function." ;
    :has_exact_synonym "FRAGILE X MENTAL RETARDATION SYNDROME"@en,
        "MARKER X SYNDROME"@en,
        "MARTIN-BELL SYNDROME"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oral_candidiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :oral_cavity ],
        :candidiasis,
        :mouth_disease ;
    :has_definition "A candidiasis that involves fungal infection of the mucous membrane of the mouth by Candida species, which is characterized by thick white or cream-colored deposits on inflamed mucosal membranes." ;
    :has_exact_synonym "Candidiasis of mouth"@en,
        "Oral moniliasis"@en,
        "Thrush, oral"@en,
        "thrush"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:benign_neonatal_seizures rdfs:subClassOf :neonatal_period_electroclinical_syndrome ;
    :has_definition "A neonatal period electroclinical syndrome that is characterized by tonic-clonic seizures in newborns occurring within the first seven days of life and ceasing within the first 15 weeks of life and has_material_basis_in autosomal dominant inheritance of voltage-gated potassium channels or a chromosomal inversion." ;
    :has_exact_synonym "benign familial neonatal seizures"@en,
        "benign neonatal convulsions"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pulmonary_valve_insufficiency rdfs:subClassOf :pulmonary_valve_disease ;
    :has_definition "A pulmonary valve disease that occurs when the pulmonary valve is not strong enough to prevent backflow into the right ventricle. If it is secondary to pulmonary hypertension it is referred to as a Graham Steell murmur." ;
    :has_exact_match "MESH:D011665" ;
    :has_exact_synonym "Pulmonic insufficiency"@en,
        "Pulmonic valve regurgitation"@en,
        "pulmonary incompetence"@en,
        "pulmonary incompetence, non-rheumatic"@en,
        "pulmonary insufficiency following trauma and surgery"@en,
        "pulmonary regurg."@en,
        "pulmonary regurgitation"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sclerosing_cholangitis rdfs:subClassOf :cholangitis ;
    :has_exact_synonym "fibrosing cholangitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atrophic_vulva rdfs:subClassOf :vulvar_disease ;
    :has_definition "A vulvar disease that is characterized by the presence of atrophy and associated with decreased estrogenization." ;
    :has_exact_synonym "Atrophy of vulva"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:shoulder_impingement_syndrome rdfs:subClassOf :arthropathy ;
    :has_exact_synonym "Impingement syndrome of shoulder region"@en,
        "Subacromial impingement"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endocrine_pancreas_disease rdfs:subClassOf :pancreas_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :endocrine_pancreas ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A pancreas disease that is located_in the endocrine component of the pancreas, consisting of islet cells (islets of Langerhans) that create and release important hormones directly into the bloodstream." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_hypertrophic_osteoarthropathy rdfs:subClassOf :syndrome ;
    :has_exact_synonym "Pachydermoperiostosis of nail"@en,
        "Pachydermoperiostosis syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neurogenic_arthropathy rdfs:subClassOf :arthropathy ;
    :has_exact_synonym "Arthropathy associated with neurological disorder"@en,
        "Charcot's arthropathy"@en,
        "Neuropathic arthropathy"@en ;
    :has_related_synonym "Charcot's joint"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brawny_scleritis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloodshot_eye ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :photophobia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        :anterior_scleritis ;
    :has_definition "An anterior scleritis that is characterized by painful inflammation and tender nodule formation of the anterior sclera and has_symptom pain, red eyes, photophobia, tearing, blurry vision, and appearance of eye surface irregularity. Nodular scleritis can be caused by autoimmune diseases, connective tissue diseases, and infection." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ebstein_anomaly rdfs:subClassOf :tricuspid_valve_disease ;
    :has_definition "A tricuspid valve disease that is a congenital heart defect in which the septal leaflet of the tricuspid valve is displaced towards the apex of the right ventricle of the heart." ;
    :has_exact_synonym "Ebstein's anomaly"@en,
        "Ebstein's anomaly of common atrioventricular valve"@en,
        "Ebstein's anomaly of right atrioventricular valve"@en,
        "Ebstein's anomaly of tricuspid valve"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:noonan_syndrome_with_multiple_lentigines rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :ra_sopathy ;
    :has_definition "A RASopathy that is characterized by autosomal dominant inheritance of brown skin spots called lentigines that are similar to freckles, heart defects, widely spaced eyes a sunken chest or protruding chest and short stature." ;
    :has_exact_synonym "LEOPARD syndrome",
        "Capute-Rimoin-Konigsmark-Esterly-Richardson syndrome"@en,
        "Generalized lentiginosis"@en,
        "Gorlin syndrome II"@en,
        "Lentiginosis profusa syndrome"@en,
        "Moynahan syndrome"@en,
        "Multiple lentigines syndrome"@en,
        "Progressive cardiomyopathic lentiginosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_dystrophy rdfs:subClassOf :vulvar_disease ;
    :has_definition "A vulvar disease that is characterized as irregular patchy areas of thickened skin and severe itching." ;
    :has_exact_synonym "Dystrophy of vulva"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tuberculous_empyema rdfs:subClassOf :pleural_empyema ;
    :has_definition "A pleural empyema which involves presence of pus in the pleural cavity and calcified visceral pleura. It results from a large number of mycobacteria spilling into the pleural space, usually from rupture of a cavity or an adjacent paranchymal focus via a bronchopleural fistula." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:skin_epithelioid_hemangioma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :endothelial_cell ],
        :hemangioma,
        :skin_benign_neoplasm ;
    :has_exact_synonym "Angiolymphoid Cutaneous hyperplasia"@en,
        "epithelioid hemangioma of skin"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pleuropneumonia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :pneumonia ;
    :has_definition "A pneumonia accompanied by inflammation of the pleura and accumulation of pus in the pleural space caused by bacteria." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blindness rdfs:subClassOf :eye_disease ;
    :has_definition "An eye disease characterized by a lack or loss of vision." ;
    :has_exact_synonym "vision impairment"@en,
        "vision loss"@en,
        "visual impairment"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:generalized_anxiety_disorder rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anxiety ],
        :anxiety_disorder ;
    :has_definition "An anxiety disorder that is characterized by long-lasting anxiety that is not focused on any one object or situation." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marfan_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :eye ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :aorta ],
        :aortic_disease,
        :connective_tissue_disease,
        :eye_disease ;
    :has_definition "A connective tissue disease that is characterized by tall stature, elongated extremities, mitral valve prolapse, aortic dilatation, aortic dissection, and subluxation of the lens." ;
    :has_exact_match "MESH:D008382" ;
    :has_exact_synonym "Marfan's syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plasmodium_malariae_malaria rdfs:subClassOf :malaria ;
    :has_definition "A malaria caused by a parasite Plasmodium malariae, which is marked by recurrence of paroxysms at 72-hour intervals." ;
    :has_exact_synonym "Malaria by Plasmodium malariae"@en,
        "Quartan Malaria"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mixed_malaria rdfs:subClassOf :malaria ;
    :has_definition "A malaria that involves infection with more than one species of Plasmodium at the same time." ;
    :has_exact_synonym "Malaria fever by more than one parasite"@en,
        "malaria by more than one parasite"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:parkinson_s_disease rdfs:subClassOf :synucleinopathy ;
    :has_definition "A synucleinopathy that has_material_basis_in degeneration of the central nervous system that often impairs motor skills, speech, and other functions." ;
    :has_exact_synonym "Parkinson disease"@en,
        "paralysis agitans"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:postencephalitic_parkinson_disease rdfs:subClassOf :secondary_parkinson_disease ;
    :has_exact_synonym "postencephalitic parkinsonism"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:estrogen_excess rdfs:subClassOf :ovarian_dysfunction ;
    :has_definition "An ovarian dysfunction that is characterized by a higher than normal ratio of estrogen." ;
    :has_exact_synonym "hyperestrogenism"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:suppurative_thyroiditis rdfs:subClassOf :thyroiditis ;
    :has_exact_synonym "Infectious thyroiditis"@en,
        "acute suppurative thyroiditis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:riedel_s_fibrosing_thyroiditis rdfs:subClassOf :thyroiditis ;
    :has_exact_synonym "Riedel fibrosing thyroiditis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:systemic_primary_carnitine_deficiency_disease rdfs:subClassOf :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that involves defective proteins called carnitine transporters, which bring carnitine into cells and prevent its escape from the body preventing the body cannot utilize fats for energy." ;
    :has_exact_synonym "carnitine transporter deficiency"@en,
        "carnitine uptake defect"@en,
        "deficiency of plasma-membrane carnitine transporter"@en,
        "primary carnitine deficiency"@en,
        "renal carnitine transport defect"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:norwegian_scabies rdfs:subClassOf :scabies ;
    :has_definition "A scabies that involves infestation of human itch mite Sarcoptes scabiei type hominis in immunocompromised and elderly persons, which is characterized by vesicles and formation of thick crusts over the skin, accompanied by abundant mites but only slight itching." ;
    :has_exact_synonym "Crusted scabies"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:parietal_lobe_neoplasm rdfs:subClassOf :cerebrum_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :parietal_lobe ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A cerebrum cancer that is located_in the parietal lobe." ;
    :has_exact_synonym "malignant neoplasm of parietal lobe"@en,
        "tumor of Parietal Lobe"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pyuria rdfs:subClassOf :urinary_system_disease ;
    :has_exact_synonym "Pus cells in urine"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thrombophlebitis_migrans rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :phlebitis ],
        :thrombophlebitis ;
    :has_definition "A thrombophlebitis that is characterized by repeated occurances of thrombophlebitis in different locations." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:protozoal_dysentery rdfs:subClassOf :dysentery ;
    :has_definition "A dysentery that involves protozoan infection." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:machado_joseph_disease rdfs:subClassOf :autosomal_dominant_cerebellar_ataxia ;
    :has_definition "An autosomal dominant cerebellar ataxia that is characterized by slow degeneration of the hindbrain and has_material_basis_in expansion of CAG triplet repeats (glutamine) in the ATXN3 gene." ;
    :has_exact_match "MESH:D017827" ;
    :has_exact_synonym "Azorean disease"@en,
        "MJD"@en,
        "SCA3"@en,
        "spinocerebellar ataxia 3"@en,
        "spinocerebellar ataxia type 3"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:capillary_leak_syndrome rdfs:subClassOf :capillary_disease ;
    :has_definition "A capillary disease characterized by hypotension, hypoalbuminemia, and hemoconcentration resulting from fluid and protein leakage out of capillaries into surrounding tissues." ;
    :has_exact_match "MESH:D019559" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_cerebellar_ataxia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :cerebellar_ataxia ;
    :has_definition "A cerebellar ataxia that has_material_basis_in autosomal dominant inheritance." ;
    :has_exact_synonym "spinocerebellar ataxia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:labyrinthine_bilateral_reactive_loss rdfs:subClassOf :labyrinthine_dysfunction ;
    :has_exact_synonym "Bilateral loss of labyrinthine reactivity"@en,
        "Loss of labyrinthine reactivity, bilateral"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:legg_calve_perthes_disease rdfs:subClassOf :osteochondrosis ;
    :has_definition "An osteochondrosis that results_in death and fracture located_in hip joint." ;
    :has_exact_synonym "Calve - Perthes' disease"@en,
        "Coxa plana"@en,
        "Juvenile osteochond-hip/pelvis"@en,
        "Juvenile osteochondrosis of hip and/or pelvis"@en,
        "Perthe's disease"@en,
        "Perthes disease"@en,
        "juvenile osteochondrosis of hip and pelvis"@en,
        "osteochondrosis of Legg-Calve-Perthes"@en,
        "pseudocoxalgia"@en ;
    :has_related_synonym "Legg-Calve-Perthes symptom"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dracunculiasis rdfs:subClassOf :parasitic_helminthiasis_infectious_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves parasitic infection by the larvae of the nematode Dracunculus medinensis, which are transmitted to humans by drinking water containing copepods infected with the larvae. The female, which contains larvae, burrows into the deeper connective tissues or adjacent to long bones or joints of the extremities. The worm emerges as a whitish filament in the center of a painful ulcer, accompanied by inflammation and frequently by secondary bacterial infection." ;
    :has_exact_synonym "Dracontiasis"@en,
        "Infection by Dracunculus medinensis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dipetalonemiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :necrosis ],
        [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :zone_of_skin ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :eye ] ;
                            rdf:rest :nil ] ] ],
        :eye_disease,
        :filariasis,
        :skin_disease ;
    :has_definition "A filariasis that is a zoonotic infection caused by the nematode of the genus Dipetalonema, which is transmitted accidentally to humans from porcupines, beavers and other mammals by mosquitoes. The adult worms live subcutaneously or in body cavities or in the eyes of humans. Dead worms cause hypersensitivity necrosis with eosinophils, followed by granulomatous reaction and fibrosis." ;
    :has_exact_synonym "Infection by Dipetalonema"@en,
        "Infection by Dipetalonema perstans"@en,
        "dipetalonema infectious disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:abnormality_of_glucagon_secretion rdfs:subClassOf :endocrine_pancreas_disease ;
    :has_exact_synonym "Glucagon secretion abnormality"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebral_degeneration rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebrum ],
        :brain_disease ;
    :has_definition "A brain disease that is characterized by loss of structure or function of neurons, including death of neurons and loss of brain tissue." ;
    :has_exact_synonym "Brain degeneration"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_tubotympanic_suppurative_otitis_media rdfs:subClassOf :suppurative_otitis_media ;
    :has_definition "A suppurative otitis media which is an inflammatory disease of the middle ear cleft characterized by the presence of a persisting perforation within the pars tensa of the tympanic membrane, intermittent profuse muco-purulent otorrhea and gradually progressive conductive hearing loss of more than 12 weeks duration. It is caused by episodes of upper respiratory infections." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cholinergic_urticaria rdfs:subClassOf :physical_urticaria ;
    :has_definition "A physical urticaria induced by sweating." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sclerosing_keratitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :photophobia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloodshot_eye ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :corneal_opacity ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :keratitis ],
        :deep_keratitis ;
    :has_definition "A deep keratitis that is characterized by inflammation of the anterior sclera and subsequent inflammation of the adjacent cornea with opacification of the corneal stroma and has_symptom pain, red eyes, photophobia, tearing, and blurry vision. Sclerosing keratitis is caused by severe anterior scleritis that causes inflammation and injury to the adjacent corneal layer. Anterior scleritis can be caused by autoimmune diseases, connective tissue diseases, and infection." ;
    :has_exact_synonym "Sclerokeratitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_closed_angle_glaucoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :ocular_hypertension ],
        :primary_angle_closure_glaucoma ;
    :has_definition "A primary angle-closure glaucoma characterized by chronic and progressive narrowing of the anterior chamber angle by an intrinsic defect such that aqueous outflow is blocked and the intraocular pressure becomes inappropriately elevated leading to optic nerve damage and visual field loss. Chronic closed-angle glaucoma has_symptom progressive loss of peripheral vision, decreased vision, and occasionally headaches. Chronic closed-angle glaucoma can be caused by anatomically narrow angle, defects in the trabecular meshwork, and iris abnormalities. Primary angle-closure glaucoma has a strong genetic component." ;
    :has_exact_synonym "Anatomical narrow angle glaucoma"@en,
        "chronic angle-closure glaucoma"@en,
        "chronic narrow angle glaucoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gonadal_dysgenesis rdfs:subClassOf :disorder_of_sexual_development ;
    :has_definition "A disorder of sexual development that is characterized by a progressive loss of germ cells on the developing gonads of an embryo." ;
    :has_exact_synonym "Gonadal dysgenesis syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:46_xy_sex_reversal rdfs:subClassOf :gonadal_dysgenesis ;
    :has_definition "A gonadal dysgenesis that is characterized by a normal 46,XY karyotype along with a progressive loss of germ cells on the developing gonads of an embryo." ;
    :has_exact_synonym "46 XY gonadal dysgenesis"@en,
        "Pure gonadal dysgenesis 46,XY"@en,
        "Swyer syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mixed_gonadal_dysgenesis rdfs:subClassOf :gonadal_dysgenesis ;
    :has_definition "A gonadal dysgenesis that is characterized by progressive loss of primordial cells on the developing glands of an embryo, leading to extremely hypoplastic and dysfuctioning gonads resulting in one differentiated gonad and either a streak gonad or streak testis." .
